INSERT INTO `stadtraetInnen` (`id`, `gewaehlt_am`, `bio`, `web`, `name`, `twitter`, `facebook`, `abgeordnetenwatch`) VALUES
(1, '1996-03-10', 'Jahrgang 1939, seit 1964 in München, verh., zwei Kinder, röm.kath., Studium Mathematik und Physik, Promotion an der TU München im Fach Physik, Physiker bei der GSF, Gymnasiallehrer.\n17 Jahre im BA ehrenamtlich tätig, von 1978 bis 1984 BA-Vorsitzender. \nMitglied im Bau-, Gesundheits-, Kinder- und Jugendhilfe-, Sozial- und Umweltausschuss.\nSeniorenbeauftragter der Fraktion.\n\nSchwerpunkte:\n- Bezahlbaren Wohnraum schaffen, \n- die Ausbildung und Erziehung Jugendlicher wertorientiert fördern,\n- gegen Gewalt und Drogenmissbrauch an Schulen, \n- gegen Benachteiligung älterer Menschen,\n- den Individualverkehr besser leiten und lenken und notwendige Parkmöglichkeiten schaffen, auch mit Tiefgaragen, \n- für gesunde Ernährung und artgerechte Tierhaltung. \n', 'http://www.dr-babor.de/', 'Dr. Babor, Reinhold', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_reinhold_babor-860-47164.html'),
(2, '1996-03-10', 'Geboren am 1. Juni 1960 in München, verheiratet, ein Sohn, eine Tochter. Selbständig. Mitglied im Stadtplanungs-, Finanz- und Gesundheitsausschuß. ', '', 'Bauernschuster, Ingrid', NULL, NULL, NULL),
(3, '1996-03-10', '&nbsp;', 'http://robert-brannekaemper.de/', 'Brannekämper, Robert', NULL, 'RobertBrannekaemper', 'http://www.abgeordnetenwatch.de/robert_brannekaemper-860-47183.html'),
(4, '1996-03-10', 'Geboren am 22. April 1940 in München, rk., Studium Mathematik/Physik an der TU München, Studienrätin und Konrektorin an städtischen und staatlichen Realschulen in München, Rektorin in der Schulverwaltung, Schulleiterin, seit 2004 Schulrektorin i.R. 19901994 Mitglied des Bezirkstags von Oberbayern.\nSeit 1996 Schulpolitische Sprecherin der CSU-Fraktion, Korreferentin des\nSchulreferats.\n\nSchwerpunkte:\n Schul- und Bildungspolitik,\n Ausbau und Weiterentwicklung der Bildungs- und Sportangebote in München,\n Bürgernähe in Politik und Verwaltung,\n Personalpolitik und solide Finanzpolitik, wirtschaftsfreundliche Politik,\n Förderung bayerischer Tradition.', '', 'Brunner, Marianne', NULL, NULL, NULL),
(5, '1996-03-10', 'Geboren am 7.2.1955 in München. Gymnasiallehrerin. Seit 1994 Mitglied des Stadtrats.\nKinder- und Jugendpolitische, schulpolitische und stv. kulturpolitische Sprecherin. Mitglied im Sportausschuss, Mitglied im Aufsichtsrat Gasteig und im Aufsichtsrat Tierpark.\n\nSchwerpunkte meiner Stadtratstätigkeit:\n- Der Ausbau und die Weiterentwicklung der städtischen Bildungsangebote.\n- Die Förderung der kulturellen Bildung.\n- Eine bessere Zusammenarbeit von Schule und Vereinen.\n- Die Förderung des Breitensports.\n- Die Förderung von Vereinen und Initiativen im Stadtteil zum Erhalt der individuellen Stadtteilkultur.\n\nDas Bewahren von Tradition und das Zulassen von Visionen ergeben ein für München stimmiges Gesamtbild.', '', 'Burkhardt, Beatrix', NULL, NULL, 'http://www.abgeordnetenwatch.de/beatrix_burkhardt-860-47165.html'),
(6, '1996-03-10', 'Verheiratet, ein erwachsener Sohn, Krankenschwester. \n\nMitglied im Gesundheitsausschuss und im Verwaltungs- und Personalausschuss.\n\nIch trete ein:\n- für eine Gesundheits-, Sozial- und Seniorenpolitik, die allen Münchnerinnen und Münchnern eine zeitgemäße, qualitative Versorgung im Krankheitsfall sichert.\n- für die Voranstellung der Bedürfnisse der Menschen vor jeder Wirtschaftlichkeitsüberlegung, damit der medizinische, therapeutische und pflegerische Fortschritt allen zugänglich ist und bleibt.\n- für eine Weiterentwicklung der Versorgungs- und Wohnformen für alte und behinderte Menschen.\n- für Präventionsmaßnahmen über alle Generationen hinweg.', 'http://www.eva-caim.de/', 'Caim, Eva Maria', NULL, NULL, 'http://www.abgeordnetenwatch.de/eva_caim-860-47166.html'),
(7, '1978-03-05', 'Ministerialrat a.D. Stadtrat seit 1972. Sein Leben wird bestimmt von Kultur und Natur. Korreferent des Kulturreferats, kulturpolitischer Sprecher der CSU-Fraktion. Er tritt ein für: Kunst und Kultur; die Erhaltung unserer Münchner Lebensart; Schutz der Bürger vor übermächtigen Bürokraten; eine Stadtpolitik, die den Herausforderungen des neuen Europa gewachsen ist; Toleranz und Respekt gegenüber Kunst und Künstlern sowie gegenüber den Kulturen der anderen; Achtung vor freiwilliger und ehrenamtlicher Leistung von Bürgern und Vereinen für die Allgemeinheit. ', '', 'Dr. Forchheimer, Franz', NULL, NULL, NULL),
(8, '1996-03-10', 'Geboren am 1. August 1971. Studium der Betriebswirtschaftslehre. Danach Einstieg in die Geschäftsführung eines mittelständischen Hotels, derzeit selbständiger Unternehmensberater.\nSeit 1996 im Stadtrat. Mitglied im Bau-, Kreisverwaltungs- sowie Finanzausschuss.\nVorsitzender der Jungen Union und des Deutschen Gewerbeverbandes im Münchner Südosten. Stellvertr. Kreisvorsitzender des Bundes der Vertriebenen.\n\nPolitische Ziele:\n Steigerung der Attraktivität Münchens als Wirtschaftsstandort;\n Förderung des Fremdenverkehrs;\n München darf nicht zum Millionendorf verkommen, ein vielfältiges\n  Kulturangebot und ein  großstädtisches Nachtleben gehören einfach dazu.', '', 'Lorenz, Andreas', NULL, NULL, NULL),
(9, '2003-10-22', 'In Heidenheim / Brenz 1959 geboren; selbständige Rechtsanwältin, Fachanwältin für Arbeitsrecht.\nGründerin und Vizepräsidentin der Tierrettung München e.V., Gründerin und Vorstandsmitglied von ?Polizisten helfen - Polizeifreunde München e.V.?. Ortsvorsitzende CSU Schwabing West, Bezirksvorsitzende CSA München \n\nStadträtin seit 1996; Stellvertretende Fraktionsvorsitzende; Mitglied im Umwelt- und im Bauausschuss; baupolitische Sprecherin; tierschutzpolitische Sprecherin; Aufsichtsrat im Tierpark Hellabrunn.\n\nPolitische Schwerpunkte:\n- Natur- und Umweltschutz.\n- Stärkung des Ehrenamtes und des Vereinswesens.\n- mehr Sauberkeit.\n- bezahlbarer Wohnraum.\n- Tierschutz.\n', 'http://www.evelyne-menges.de/', 'Dr. Menges, Evelyne', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_evelyne_menges-860-47184.html'),
(10, '1978-03-05', 'Geboren am 11. Februar 1939, Industriekauffrau, verheiratet, zwei erwachsene Kinder.\n\nMitglied im Ausschuss für Arbeit und Wirtschaft und im Gesundheitsausschuss.\n\nAufsichtsrat: Stadtwerke München GmbH, MVG, GWG und Bayerngas; \n\nMitglied im Auschuss für Wirtschaft und Verkehr im Bayer. Städtetag.\n\nIm Stadtrat seit 1978. \n', '', 'Nagel, Ilse', NULL, NULL, NULL),
(11, '1990-03-18', 'Geboren am 23. Januar 1939 in München, verheiratet, vier Töchter, zwei Söhne.\n\nIm Stadtrat seit 1990:\n&#8226;	Sozialpolitische Sprecherin der CSU-Fraktion\n&#8226;	Mitglied in den Ausschüssen Soziales, Schule, Sport, Gesundheit\n&#8226;	Aufsichtsratmitglied beim Deutschen Theater, bei der Münchenstift und bei der Städt. Wohnungsbaugesellschaft (GWG)\n&#8226;	Verwaltungsbeirätin beim Allgemeinen Sozialdienst\n', '', 'Oberloher, Gisela', NULL, NULL, NULL),
(12, '1990-03-18', 'Geboren 1939 in München, verh., eine Tochter, röm.-kath., Lehre als Geldschrank- und Tresorbauer, 1964 Eintritt bei der Stadtpolizei München. Jetzt Sachbearbeiter bei der Kripo. Seit 1990 im Stadtrat. Schwerpunkte sind: Sicherheit in München; Sozialer Wohnungsbau - bei gerechter Vergabe, vordringlich an Einheimische; Erhaltung und Neuausweisung von Kleingärten; Pflege der Münchner Lebensart und Biergartenkultur. ', '', 'Pertschy, Peter', NULL, NULL, NULL),
(13, '1994-06-12', 'Geboren am 11.11.1941 in München. Verheiratet, eine Tochter.\nMittlere Reife, Stadtdirektor a.D.\n\nSeit 1994 im Stadtrat. Korreferent im Kommunalreferat, Sprecher der CSU im Verwaltungs- und Personalausschuss, Mitglied im Kommunal- und Rechnungsprüfungsausschuss, im Ausschuss für Arbeit und Wirtschaft sowie in den Aufsichtsräten, der Messe München und der Städtischen Klinikum München GmbH und des Gewerbehof- und Technologiezentrums.\n\nArbeitsschwerpunkte:\n	Bürgerfreundliche Verwaltung\n	gesunde, sichere Arbeitsplätze\n	Steuer- und Gebührenstabilität\n	Mittelstandsförderung\n	Wohnungen für Münchner Familien\n	Stadtteilkultur und Vereinsförderung\n', '', 'Pfundstein, Helmut', NULL, NULL, NULL),
(14, '1978-03-05', 'Geboren am 18. September 1946 in München. Verheiratet.\n\nWirtschaftsaufbauschule, Dipl.-Verwaltungswirt (FH).\n\nSeit 1978 im Stadtrat, Fraktionsvorsitzender der CSU.\n\nMitglied im Ausschuss für Stadtplanung und Bauordnung und im Kommunalausschuss.\n\nKommunalpolitische Schwerpunkte:\n- Sicherheit in der Großstadt,\n- Erhaltung und Schaffung von Arbeitsplätzen durch Förderung der kommunalen Wirtschaft,\n- Bezahlbarer Wohnraum,\n- Vereinsförderung,\n- Tierschutz.', '', 'Podiuk, Hans', NULL, NULL, 'http://www.abgeordnetenwatch.de/hans_podiuk-860-47168.html'),
(15, '1996-03-10', 'Geboren am 30. Juni 1952 in Friedrichshafen, verheiratet, vier Kinder.\nSeit 1955 in München, Verlagsbuchhändler und Journalist. Leiter des Infopoint Museen & Schlösser in Bayern.\nStadtrat seit 1996, Fraktionsschatzmeister.\nMitglied im Kulturausschuss und im Ausschuss für Arbeit und Wirtschaft. Kultursprecher der CSU-Fraktion, Korreferent des Kulturreferates und Innenstadtsprecher der CSU-Fraktion.\n\nEr tritt ein für:\n- Ausbau, Erhalt und Förderung der Kunst- und Kulturlandschaft.\n- Stärkung der Münchner Wirtschaftskraft und mittelständischer Unternehmen.\n- Ausgewogene Verkehrspolitik.\n- Bürgerfreundliche Planung und Verwaltung.\n- Familien- und kinderfreundliches München.', 'http://www.richardquaas.de/', 'Quaas, Richard', NULL, NULL, 'http://www.abgeordnetenwatch.de/richard_quaas-860-47178.html'),
(16, '1994-06-12', 'Geb. am 4.10.1960 in München, röm-kath., humanist. Abitur. Studium: Rechts- und Polit. Wissenschaften, Stipendiat der Konrad-Adenauer-Stiftung. Wehrdienst bei der Feldjägerausbildungskompanie. 1982-1996 VHS-Dozent für Latein, 1992-1996 nebenamtl. Repititor für Öffentl. Recht. Seit 1992 jur. Staatsbeamter, tätig im Bayer. Umweltministerium, als Landtagsassistent, Referent bei der Reg. von Obbayern., z. Zt. Oberregierungsrat am LRA Ebersberg. 1984-1996 Mitglied im BA Milbersthofen-Am Hart. Seit 1994 Stadtrat: Mitglied im Kreisverwaltungs-, Kommunal- und Finanzausschuß sowie im Ausschuß für Stadtplanung. ', '', 'Ruhfaß, Thomas', NULL, NULL, NULL),
(17, '1990-03-18', 'Geboren in München, verheiratet, drei Töchter. Studium der Romanistik und Germanistik in München und im Ausland, Gymnasiallehrerin, Autorin.\n\nStv. Fraktionsvorsitzende Stadträtin der FREIEN WÄHLER \nAusschüsse: Bildung, Sport, Kultur, Verwaltung und Personal, IT. Mitglied im Dt. Städtetag, im Philharmonischen Rat, in den Kommissionen für Tourismus, Frauengleichstellung, Kunst am Bau, Europa, u.a. Aufsichtsrätin für das Volkstheater. \n\nMotto: Politik mit Herz und Hirn. Der Politik ein menschliches Gesicht geben. \n\nBesondere Ziele u.a.:\n- Kultur für alle,\n- ganzheitliche Erziehung in der Schule,\n- unverkrampfte Frauenpolitik,\n- Förderung des Mittelstandes,', 'http://www.ursula-sabathil.de/', 'Sabathil, Ursula', NULL, 'pages/Ursula-Sabathil-offiziell/430691137012123', 'http://www.abgeordnetenwatch.de/ursula_sabathil-860-47185.html'),
(18, '1984-03-18', 'Geboren am 11. Januar 1949 in Memmingen. Verheiratet, zwei Töchter. 1968 Abitur am humanist. Ludwigsgymnasium; Wehrdienst; Jurastudium an der Universität München. Selbständiger Kaufmann. Mitbegründer und heute Alleininhaber einer Bildungseinrichtung.\n1978&#8211;90 Vorsitzender des BA Pasing.\n\nSeit 1987 Mitglied des Stadtrats.\nFinanzpolitischer Sprecher der CSU-Fraktion, Mitglied im Finanzausschuss, Ausschuss für Stadtplanung und Bauordnung, Umweltausschuss.\nZiele:\n&#8226;	Solide Finanzpolitik,\n&#8226;	Verkehrs- und Planungsfragen,\n&#8226;	Förderung des Mittelstandes und\n&#8226;	der Münchner Vereine.\n&#8226;	&#8222;Mehr Gelassenheit in der Politik&#8220;.\n\nMünchner Schützen-Stadtrat.\n', '', 'Schmatz, Thomas', NULL, NULL, NULL),
(19, NULL, 'Geboren 1952 in München.\nVerheiratet, zwei Kinder, Bürokaufmann, Handelsfachwirt, Wehrdienst 1974 bis 1978.\n\nPolitische Schwerpunkte:\n- Münchner Klein- und Mittelstandsförderung\n- Kommunales Bauen\n- Vereins- und Breitensport\n- Förderung des Kinder- und Jugendsport\n- Verantwortungsvolle Integrationspolitik.\n\nMitglied im Sportausschuss, sportpolitischer Sprecher der CSU-Fraktion und Mitglied im Ausschuss für Arbeit und Wirtschaft.', '', 'Schmidbauer, Mario', NULL, NULL, 'http://www.abgeordnetenwatch.de/mario_schmidbauer-860-47181.html'),
(20, '1996-03-10', 'Geb. am 24. Juni 1941 in Mannheim, ev., 1 Tochter. Wirtschaftsabitur. Sprachstudien. Seit 1972 in München, selbst. Reise-Kauffrau (Kunstführungen, Kulturreisen). Seit 1990 ehrenamtliche Vorsitzende der BÜRGERINITIATIVE PETUELRING EV-Pro Tunnel Aktion. Mitglied im Ausschuß für Bau, Umweltschutz und Kinder- und Jugendhilfe. Besondere Anliegen: Untertunnelung Mittlerer Ring, ÖPNV-Ausbau mit Ringvernetzung, Münchens Wirtschaft und Tourismus, Kulturpolitik, Denkmalpflege. Erhaltung des Englischen Gartens als Naturdenkmal. ', '', 'Schöne, Barbara', NULL, NULL, NULL),
(21, '1978-03-05', '&nbsp;', '', 'Schosser, Elisabeth', NULL, NULL, NULL),
(22, '1994-06-12', 'Geboren am 12. Januar 1935 in München. Verheiratet, drei Kinder, röm.-kath., Ludwigsoberrealschule, Dipl.-Verwaltungswirt (FH), 1972 Mitglied im Bezirksausschuß Hadern, seit 1978 - mit einer zweieinhalbjährigen Unterbrechung - im Stadtrat. Tritt ein für eine bürgernahe und effektive Verwaltung, zügigen Weiterbau der U-Bahn. Verkehrsberuhigung in den Stadtvierteln, Volks- und Brauchtumspflege und Förderung des Breitensports. Mitglied im Ausschuß für Arbeit und Wirtschaft, Rechnungsprüfungs- und Sportausschuß. ', '', 'Schwetzler, Theodor', NULL, NULL, NULL),
(23, '1978-03-05', 'Geboren 24. September 1933 in München. Verheiratet, drei Kinder. Abitur am Wittelsbacher Gymnasium. Abgeschlossene Lehre als Industriekaufmann, Studium der Volkswirtschaft und der politischen Wissenschaften an der Universität München. Direktionsbevollmächtigter einer Versicherungsgesellschaft. Seit 1972 im Stadtrat, baupolitischer und sportpolitischer Sprecher der CSU-Fraktion. Mitglied des Vorstands der CSU-Fraktion. Politische Schwerpunkte: Wirtschafts-, Bau-, Sport- und Finanzpolitik. ', '', 'Wiedemann, Adi', NULL, NULL, NULL),
(24, '1994-06-12', 'Geboren am 20. Oktober 1964 in München. Abitur 1982. Studium der Informatik an der TU München; Diplom mit Auszeichnung. Berufstätig in der Entwicklung von Software-Produkten. Seit 1994 im Stadtrat. Verkehrspolitischer Sprecher der CSU-Stadtratsfraktion. Politische Schwerpunkte: Verbesserungen statt Einschränkungen im Straßenverkehr; Ausbau von U- und S-Bahn; Nutzung moderner Technologien, moderne und bürgernahe Verwaltung. Mitglied in: Bau-, Umwelt-, Verwaltungs- und Personalausschuß.', '', 'Wiehle, Wolfgang', NULL, NULL, NULL),
(25, NULL, 'Geb. am 12.12.1967 in München, zwei Kinder. Rechtsanwältin.\n\nSeit 1994 Mitglied des Münchner Stadtrats. Stv. Fraktionsvorsitzende. \n\nSprecherin im Ausschuss für Bildung und Sport. Mitglied und stv. Korreferentin im Ausschuss für Stadtplanung und Bauordnung, stv. Sprecherin im Finanzausschuss.\n\nStv. Aufsichtsratsvorsitzende der GWG, Mitglied der Bauleitplankommission, Mitglied im Riembeirat, in der Kommission Freiham und im Aufsichtsrat der Olympiapark GmbH.\n\nTrägerin der Medaille ?München leuchtet? in Gold und der Medaille für besondere Verdienste um die kommunale Selbstverwaltung.', 'http://www.mechthilde-wittmann.de/', 'Wittmann, Mechthilde', NULL, 'Mechthilde-Wittmann', 'http://www.abgeordnetenwatch.de/mechthilde_wittmann-860-47175.html'),
(26, '1990-03-18', 'Geboren am 6. Juli 1946 in Unterneukirchen/Landkreis Altötting. Mit 4 Monaten nach München gekommen. 1965 Abitur am Theresiengymnasium. Nach dem Wehrdienst Jurastudium in München. Selbständiger Rechtsanwalt.\n\nVon 1972&#8211;1984 im Bezirksausschuss Berg am Laim. Seit 1982 CSU-Vorsitzender in Berg am Laim.\n \nCSU-Sprecher im Kreisverwaltungsausschuss, Kommunalausschuss, Sportausschuss.\n \nZiele:\n&#8226;	Politik und Verwaltung müssen wirtschaftlich denken und\n	handeln.\n&#8226;	Fortschritt und Umweltschutz sind vereinbar.\n&#8226;	Vereine helfen Freizeit preiswert gestalten.\n', '', 'Wolfswinkler, Hans', NULL, NULL, NULL),
(27, '1996-03-10', 'Geboren am 28. Februar 1940.\nNotar.\n\nMitglied im Hauptausschuss und Bauausschuss des Deutschen Städtetages.\n\nVerwaltungsbeirat für Film und Medien und der Lokalbaukommission (LBK).\n\nStellvertretender Aufsichtsratsvorsitzender der Olympiapark GmbH, Mitglied im Aufsichtsrat der Filmwochen GmbH.\n\nIm Stadtrat seit 1972, Planungssprecher der CSU-Stadtratsfraktion.\n\nTräger der Goldenen Bürgermedaille und der Kommunalen Verdienstmedaille in Silber.', '', 'Zöller, Walter', NULL, NULL, 'http://www.abgeordnetenwatch.de/walter_zoeller-860-47172.html'),
(28, '1996-03-10', '&nbsp;', '', 'Zöttl, Vinzenz', NULL, NULL, 'http://www.abgeordnetenwatch.de/vinzenz_zoettl-860-47173.html'),
(29, NULL, '&nbsp;', '', 'Dr. Anker, Ingrid', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_ingrid_anker-860-47199.html'),
(30, '1996-03-10', 'Geboren 1947 in München, Jurist in der LVA Oberbayern, im Stadtrat seit 1984, Korreferent im Personal- und Organisationsreferat. Politische Schwerpunkte: Reform der Stadtverwaltung; für mehr Bürgernähe und Stärkung der Verantwortung aller MitarbeiterInnen der Stadt; städt. Aktivitäten zur Völkerverständigung; Auseinandersetzung mit Ausländerfeindlichkeit und Rechtsradikalismus', '', 'Baumann, Gerd', NULL, NULL, NULL),
(31, '1996-03-10', 'Geboren am 2. März 1957 in Cremona/ Italien. Italienerin, Restauratorin, verheiratet, zwei Söhne.\nSeit 1981 in München.\nAbitur, Fachschule für Fresken und Gemälderestaurierung.\nMitglied im Schulausschuss, Sozialausschuss und Sozialhilfeausschuss.\n\nSchwerpunkte:\n Seniorenpolitik unter Einbeziehung der nichtdeutschen Mitbürger. Aktive Teilnahme der älteren Mitbürger am gesellschaftlichen Leben.\n Strukturelle Unterstützung der Familien, Kindergärten und Schulen auch als Instrument des gesellschaftlichen Miteinanders.\n Den Umweltgedanken in Schulen und Kindergärten fördern.', '', 'Colonnella, Fiorenza', NULL, NULL, NULL),
(32, '1996-03-10', 'Ich bin gelernte Gärtnerin mit Diplomen für Landschaftsarchitektur und Geographie in Weihenstephan und München. Verheiratet, ein Sohn. Geboren 1942 in Bamberg lebe ich seit 1964 in München, in Haidhausen seit 1972. Seit 1989 bin ich im Stadtrat.Schwerpunkte meiner Arbeit: Grün- und Erholungsflächen, städtische Freiräume, praktische Umweltschutzpolitik, stadtverträglicher Verkehr, Stadtsanierung, Wohnen, Anliegen der Familien. ', '', 'Dietz-Will, Adelheid', NULL, NULL, NULL),
(33, '1996-03-10', 'Geboren am 1. November 1947 in Frankfurt/Main, verheiratet, eine Tochter. 1962 Lehre als Modellbauer. Tätigkeit als Modellbauer in verschiedenen Unternehmungen. 1972 bis 1975 Volkswirtschaftsstudium in Hamburg. 1976 Organisationssekretär im DGB Kreis München. 1982 2.Vorsitzender und seit 1987 1. Vorsitzender der IG Metall München. Besondere Anliegen: Sicherung der Arbeitsplätze und des Wirtschaftsstandortes München, Wohnungsbau und die sozialen Anliegen der Arbeitnehmer/-innen. ', '', 'Flassbeck, Harald', NULL, NULL, NULL),
(34, '2002-03-03', 'Geboren am 3.3.1940 in Platamon Kavala, Nord-Griechenland.\nVerheiratet, 2 Kinder. Seit 1964 in Deutschland, seit 1969 in München.\nAbschluß der Mittleren Reife 1959. Erwerb des Diploms für Funkkommunikationswesen 1962.\nVon 1.01.196430.06.1977 bei der Firma Metzeler AG in München als Werksangestellter und von 1.7.1977 bis 31.12.1998 Gewerkschaftssekretär beim DGB-Landesbezirk Bayern beschäftigt.\nVon 1992 bis 1996 Vorsitzender des Münchner Ausländerbeirats.\nSeit 1996 im Stadtrat.\n\nKommunalpolitische Schwerpunkte:\n Sozialpolitik,\n Förderung der Integration von Migrantinnen und Migranten,\n Stärkung der interkulturellen Kommunikation.\n\nMitglied im Sozialhilfeausschuss, Sozialausschuss und Kreisverwaltungsausschuss.', '', 'Gavras, Theodoros', NULL, NULL, NULL),
(35, '1990-03-18', 'Am 3.1.1949 in Coburg geboren. Münchnerin seit 1969. Verheiratet.\nStudium Lehramt an Volksschulen. Selbstständig. Ehrenamtliche Richterin am Verwaltungsgericht München. Vorsitzende der AWO Neuhausen.\nIm Stadtrat - mit zweieinhalbjähriger Unterbrechung - seit 1990.\nMitglied im Sozial- und Kinder- und Jugendhilfeausschuss.\nKinder- und jugendpolitische Sprecherin der SPD-Fraktion.\n\nSchwerpunkte:\n Bedarfsgerechter Erhalt der sozialen Infrastrukturen\n Kinder- und familienfreundliche Stadt\n Anliegen von Kindern und Jugendlichen ernst nehmen und in der politischen Arbeit umsetzen\n Seniorinnen und Senioren ein selbstbestimmtes Leben in Würde  ermöglichen\n bürgernahe Verwaltung', '', 'Gebhardt, Angelika', NULL, NULL, NULL),
(36, '1996-03-10', 'Geboren am 24. August 1967 in München, verheiratet, eine Tochter. Grundschule und Gymnasium in München. Jurastudium in Augsburg und München. Studium an der Bayerischen Akademie für Werbung und Marketing. Seit 1995 beschäftigt in der Presseabteilung eines privaten Fernsehsenders.Seit dem 7. Oktober 1998 Mitglied des Stadtrats. Mitglied im Gesundheitsausschuß und im Sportausschuß.Schwerpunkte meiner politischen Arbeit: Schaffung von preiswerten Wohnungen, eine vernünftige Drogenpolitik, Politik für junge Menschen in München. ', '', 'Gräbner, Hannes', NULL, NULL, NULL),
(37, '1990-03-18', 'Geboren am 16. Juli 1940 in Garmisch- Partenkirchen. Verheiratet, zwei Kinder.\nSeit 1962 in München. Abitur, Ausbildung für den gehobenen Dienst der Finanzverwaltung. Mitarbeiterin einer Steuerkanzlei. Jura-Studium als Werkstudentin. Rundfunkjournalistin. Vorsitzende/Referentin des Rechnungsprüfungsausschusses\n\nBesondere Anliegen:\n Ausgewogene, sparsame Finanzpolitik mit Priorität im sozialen Bereich,\n ausreichend Kindergarten- und Hortplätze, Mittagsbetreuung\n menschenwürdiges Leben für Familien und alte Menschen,\n mehr Gerechtigkeit für Frauen.\n Fortschrittliche Schulpolitik und\n Förderung des Breitensports.\n Erneuerung von Sportanlagen,\n Förderung der Jugendarbeit in den Sportvereinen.', '', 'Hochstätter, Ida', NULL, NULL, NULL),
(38, '1996-03-10', 'Geboren am 14.7.1951 in Gundelfingen/Donau, seit 1970 in München.\n\nChemotechnikerin und Betriebsratsvorsitzende bei Rohde & Schwarz.\nMitglied im Ortsvorstand der IG Metall München und im Wirtschaftsforum der Sozialdemokratie.\nEhrenamtliche Richterin am Arbeitsgericht und Finanzgericht.\nSeit 1996 im Stadtrat, Mitglied im Ausschuss für Arbeit und Wirtschaft, Finanzausschuss und Kulturausschuss.\n\nZiele:\n München muss weiterhin eine Stadt für Arbeitnehmer/-innen und ihre Familien bleiben.\n Im Vordergrund von Kulturpolitik steht eine Gesellschaft, in und mit der sich Kultur und Kunst entwickeln können.', '', 'Jahn, Stefanie', NULL, NULL, NULL),
(39, '1990-03-18', 'Geboren am 27. September 1955 in Memmingen, verheiratet, zwei Kinder, seit 1976 in München. Gymnasiallehrer, M.A. in Philosophie, Linguistik, Logik und Wissenschaftstheorie.\nSeit 1990 im Stadtrat. \nStv. Fraktionsvorsitzender\n\nWichtigste Zielsetzungen:\n- Eine solidarische Stadtgesellschaft verwirklichen und damit den sozialen Frieden sichern,\n- die Grundbedürfnisse der Menschen (Arbeit und Wohnen) in den Mittelpunkt der politischen Arbeit stellen,\n- Urbanität human gestalten und\n- Demokratie erlebbar machen,\n- kulturelle Vielfalt bewahren und fördern,\n- Platz für Kinder und Räume für Jugendliche schaffen,\n- weiterhin für eine solide Finanzpolitik in München sorgen.', 'http://www.hans-dieter-kaplan.de/', 'Kaplan, Hans Dieter', NULL, NULL, 'http://www.abgeordnetenwatch.de/hans_dieter_kaplan-860-47209.html'),
(40, '1996-03-10', 'Geboren am 14. Juni 1943 in München, zwei Töchter, kaufmännische Lehre, Sekretärin.\nWar 12 Jahre im Bezirksausschuss Allach-Untermenzing. Jugendschöffin, ehrenamtliche Richterin am Sozial- und Verwaltungsgericht.\n\nSeit 1996 im Stadtrat.\n\nSchwerpunkte:\n zukunftsweisende Stadtplanung,\n Ausbau des öffentl. Nahverkehrs,\n Schaffung von preiswerten Wohnungen sowie\n Kleingartenanlagen und Naherholungsgebieten;\n Behindertenpolitik,\n Qualitätsförderung des städtischen Bildungssystems.\n\nMitglied im Schul-, Stadtentwässerungs- und im Bauausschuss, Verwaltungsbeirätin Tiefbau.', '', 'Köstler, Heidemarie', NULL, NULL, NULL),
(41, '1990-03-14', 'Geboren am 11. Oktober 1936 in München. Geschieden, vier Kinder. Volks- und Berufsschule, Ausbildung als Maschinenschlosser, Weiter- und Fortbildung. Seit 1973 Angestellter in einer Gemeinützigen Wohnungsbaugesellschaft. 1984-1990 Vorsitzender des Ramersdorf-Perlacher Bezirksausschusses. Seit 1990 im Stadtrat. Schwerpunkte der Stadtratsarbeit: Stadtplanung und Stadtentwicklung, insbesondere Förderung der Stadtteile, Verkehrsberuhigung in Wohngebieten, Verbesserung und Ausbau des öffentl. Personennahverkehrs. ', '', 'Kreitl, Norbert', NULL, NULL, NULL),
(42, '1990-03-18', 'Geboren am 21. September 1944 in Zwickau. 19461958 in Berlin, dann in München. 1963 Abitur am Maxgymnasium, Studium der Volkswirtschaft, Geschichte, Politik, 1. und 2. Staatsexamen für das Lehramt.\n\nSeit 20 Jahren Mitglied im Bezirksausschuss Altstadt-Lehel.\n\nSchwerpunkte für die Stadtratsarbeit:\n\n Wohnraumerhaltung; Mieterschutz und Wohnungsbau;\n umweltverträgliche Energiepolitik;\n stadtverträgliche Verkehrspolitik:\nVorrang für U-Bahn, Bus und Tram, für Fußgänger und Radler,\nausreichendPlatz für Taxis und Wirtschaftsverkehr;\n mehr Platz für Kinder und Jugendliche.', '', 'Dr. Lange, Thomas', NULL, NULL, NULL),
(43, '1990-03-18', '&nbsp;', 'http://www.haimo-liebich.de/', 'Liebich, Haimo', NULL, NULL, 'http://www.abgeordnetenwatch.de/haimo_liebich-860-47211.html'),
(44, '1984-03-18', 'Geboren am 18. September 1944, verheiratet, Chemotechnikerin.\n\nSeit 1984 Mitglied des Stadtrates.\n\nKommunalpolitische Schwerpunkte:\n Stadtentwicklung und Stadtplanung,\n Wohnungsbau,\n Umweltschutz,\n Energie- und Verkehrspolitik.\n\nMitarbeit in den Ausschüssen Stadtplanung und Bauordnung, Umweltschutz und Kommunales.\nStellvertretende Vorsitzende der SPD-Stadtratsfraktion; Mitglied des Ältestenrates.', '', 'Lindner-Schädlich, Constanze', NULL, NULL, NULL),
(45, '1996-03-10', 'Geb. 1965.\n\nPädagogin MA, Dipl. Sozialpädagogin (FH).\n\nMitglied im Stadtrat seit 1996.\n\nSozialpolitische Sprecherin der SPDStadtratsfraktion. Mitglied im Sozialausschuss und Verwaltungs- und Personalausschuss.\n\nSchwerpunkte:\n\n Verbesserung der stadtteilnahen Versorgung unserer Seniorinnen und Senioren\n Sicherung der solidarischen Stadtgesellschaft\n Bekämpfung von Armut und Langzeitarbeitslosigkeit\n Stärkung des zweiten Arbeitsmarktes.', '', 'Meier, Brigitte', NULL, NULL, NULL),
(46, '1978-03-05', '7. Mai 1939 in München geboren, verheiratet, zwei Söhne und sechs Enkelkinder. Versicherungskaufmann. Seit 1972 ehrenamtlicher Münchner Stadtrat. Wirtschaftspolitischer Sprecher der SPD-Stadtratsfraktion. Ausschüsse: Arbeit und Wirtschaft, Riem und Sport. Aufsichtsrat: Münchner Messe und Olympiapark. Seit 1994 auch im Bayerischen Landtag. ', '', 'Memmel, Hermann', NULL, NULL, NULL),
(47, '1998-10-07', 'Geboren am 17. Oktober 1935 in Essen. Verheiratet, zwei Töchter, zwei Enkel, seit 1955 in München. Abitur, Diplom der Technischen Universität München, Fachrichtung Architektur, Fortbildung in Städtebau, Stadtsoziologie und Verwaltungsrecht, seit 1965 selbständiger Architekt und Stadtplaner. Besondere Anliegen: Stadtentwicklung und Stadtgestaltung im Interesse der Münchner Bürger; Kultur, Sport und bürgerschaftliches Engagement als selbstverständliche Bestandteile des Münchner Alltags. ', '', 'Otto, Frank', NULL, NULL, NULL),
(48, '1984-03-18', 'Geboren am 24. November 1934 Berlin. Verheiratet, zwei Söhne, eine Tochter. Abitur 1954 in Nürnberg. Studium an der FHS München. Abschluß als Dipl. Wirtschaftsingenieurin. Anschließend 10 Jahre für einen Münchner Elektrokonzern tätig. Stadträtin seit 1984. Umweltpolitische und stellvertretende Finanzsprecherin der SPD-Fraktion. Schwerpunkte: Finanz- und Wirtschaftspolitik, aktive Arbeitsmarktpolitik der Stadt, Berücksichtigung ökologischer Gesichtspunkte bei der Stadtpolitik, Energieversorgungsfragen. ', '', 'Prechtel, Hannelore', NULL, NULL, NULL),
(49, '1990-03-18', 'Geboren am 26. September 1944 in Unternogg/Unterammergau. Verheiratet, 2 Kinder. Bürokauffrau. Seit 1964 in München.\n\nStadträtin seit 1990.\nSprecherin der SPD im Kommunalausschuss.\nMitglied im Planungsausschuss, Komunalausschuss und Bauausschuss.\n \nSchwerpunkte:\n	Erhaltung preiswerten Wohnraumes,\n	Ausbau des öffentlichen Nahverkehrs,\n	Stadtentwicklung,\n	Sicherung des Klein- und mittelständischen Gewerbes,\n	bürgernahe Verwaltung,\n	Einhaltung des Verbraucherschutzes,\n	Verbesserung der Lebensqualität in der Innenstadt.\n	Tierschutz.\n\nVerstorben am 29.08.2007', '', 'Purucker-Seunig, Christl', NULL, NULL, NULL),
(50, '1996-03-10', 'Geboren am 15.2.1958 in München. Sparkassenangestellter. \nSeit 1996 im Stadtrat.\nFraktionsvorsitzender.\nSprecher im Bauausschuss.\nMitglied im Ausschuss für Arbeit und Wirtschaft und im Kommunalausschuss. Mitglied in den Aufsichtsräten der Stadtwerke München, des Städtischen Klinikums und der Deutsches Theater  Grund- und Hausbesitz GmbH.\n1978 bis 1996 im Bezirksausschuss Moosach, von 1984 bis 1996 Bezirksausschuss-Vorsitzender.\n\nBesondere Interessen:\n- Stadtentwicklung und Stadtplanung.\n- Kommunales Bauen.\n- Verkehr, leistungsfähiger Nahverkehr.\n- Wirtschaftspolitik und kommunale Daseinsvorsorge.\n- Solide Stadtfinanzen.', '', 'Reissl, Alexander', NULL, NULL, 'http://www.abgeordnetenwatch.de/alexander_reissl-860-47216.html'),
(51, '1990-03-18', '&nbsp;', '', 'Renner, Monika', NULL, NULL, 'http://www.abgeordnetenwatch.de/monika_renner-860-47217.html'),
(52, '1978-03-05', '&nbsp;', '', 'Scheuble-Schaefer, Barbara', NULL, NULL, 'http://www.abgeordnetenwatch.de/barbara_scheuble_schaefer-860-47221.html'),
(53, '1984-03-18', 'Geboren am 2. Oktober 1945 in München, verheiratet, zwei Töchter. \nAusbildung als Großhandelskaufmann und Dipl. Verwaltungswirt (FH).\n\nIm Stadtrat seit 1984. Wirtschaftspolitischer Sprecher der SPD-Fraktion.\n\nAusschüsse:\n- Ausschuss für Arbeit und Wirtschaft\n- Kreisverwaltungsausschuss\n- Gesundheitsausschuss\n\nBesondere Anliegen bei der Rathausarbeit:\n- Wahrnehmung von Arbeitnehmerinteressen;\n- kommunale Wirtschafts-, Investitions- und Beschäftigungspolitik;\n- städtische Energiepolitik;\n- Förderung des öffentlichen Personennahverkehrs;\n- Erhalt und Förderung von Tradition und Brauchtum.', '', 'Schmid, Helmut', NULL, NULL, 'http://www.abgeordnetenwatch.de/helmut_schmid-860-47222.html'),
(54, '1978-03-05', 'Geboren am 17. September 1939 in Donauwörth. Verheiratet, zwei Kinder. Seit 1953 in München. Abitur, Studium an der Päd. Hochschule Pasing. Lehrerin an Volksschulen. Seit 1978 im Stadtrat. Schwerpunkte: Schul- und Umweltpolitik. Ausreichende Versorgung mit vorschulischen Einrichtungen, schulischen Ganztagseinrichtungen und eine bessere Ausstattung von Berufsschulen. Mehr Orientierungsstufen und Gesamtschulen. ', '', 'Schmidt, Gertraud', NULL, NULL, NULL),
(55, '1990-03-18', 'Geboren am 2. März 1961 in München, verwitwet, zwei schulpflichtige Kinder\n\nAbitur am Theresiengymnasium, Studium der Politikwissenschaft, Germanistik und Geschichte an der Ludwig-Maximilians-Universität München. Anschließend als wissenschaftliche Mitarbeiterin tätig.\n\nSeit 1982 aktiv in der Politik, 1985 bis 1987 Vorsitzende der Münchner Jusos. \nVon 1990 bis Dezember 2005 ehrenamtliche Stadträtin. Korreferentin des Personal- und Organisationsreferates, stellvertretende Vorsitzende der SPD-Stadtratsfraktion. 1996 bis 2002 Vorsitzende der Arbeitsgemeinschaft sozialdemokratischer Frauen. Mehrere Jahre Vorsitzende der städtischen Gleichstellungskommission\n\nAm 14. Dezember 2005 zur 2. Bürgermeisterin gewählt, mit Amtsantritt am 2. Januar zuständig für die Sozialausschüsse, die Ausschüsse für Schule und Sport, den Kommunalausschuss, für Bürgerangelegenheiten und die Bezirksausschüsse, Aufsichtsratsvorsitzende der Münchner Tierpark AG sowie der MÜNCHENSTIFT GmbH.\n\nZielsetzung:\n"Trotz aller Sparzwänge werde ich mich insbesondere im sozialen Bereich engagieren, vor allem für gleiche Bildungschancen für alle Kinder, Jugendliche, Familien und Behinderte. Angesichts der demographischen Entwicklung muss verstärkt auch die ältere Generation im Fokus der Politik stehen. Das Miteinander aller Generationen und eine ausgewogene Berücksichtigung der jeweiligen Lebenssituation muss Richtschnur für ein zukunftsorientiertes und verantwortungsvolles Handeln der Stadt sein. Der Erhalt der kommunalen Daseinsvorsorge mit seinen vielfältigen Leistungen muss weiterhin gesichert bleiben, damit München seinen Bürgerinnen und Bürgern auch in Zukunft Heimat bleibt.\nDaneben möchte ich als Bürgermeisterin auch weiterhin einige verwaltungsinterne Themen transportieren."', '', 'Strobl, Christine', NULL, NULL, 'http://www.abgeordnetenwatch.de/christine_strobl-860-47226.html'),
(56, '1996-03-10', 'Geboren am 22. Juli 1964 in Vilsbiburg/Niederbayern; seit 1985 in München.\n\nStudium der Wirtschaftsgeographie, Politik und Landwirtschaft an der Technischen Universität; Abschluss 1992; ledig.\nSeit 1996 im Stadtrat.\nStellvertretende Fraktionsvorsitzende und Sprecherin im Planungsausschuss.\n\nArbeitsschwerpunkte:\n- soziale und ökologische Stadtentwicklung\n- bezahlbare Wohnungen für alle\n- Sicherung der Lebensqualität\n- Mieterschutz.\n\nAusschüsse: Ausschuss für Stadtplanung und Bauordnung, Finanzausschuss.', 'http://claudia-tausend.de/', 'Tausend, Claudia', NULL, NULL, 'http://www.abgeordnetenwatch.de/claudia_tausend-860-47227.html'),
(57, NULL, '&nbsp;', 'http://christian-ude.de/', 'Ude, Christian', NULL, NULL, 'http://www.abgeordnetenwatch.de/christian_ude-860-47228.html'),
(58, '1990-03-18', 'Geb. am 16. November 1948 in Wasserburg/Inn, ein Sohn. Organisationsschwester im Klinikum rechts der Isar.\nSeit 1990 im Stadtrat. Mitglied im Sozial-, Planungs- und Riemausschuss.\nWohnungspolitische Sprecherin der SPD-Stadtratsfraktion, Vorsitzende der städtischen Arbeitsgruppe Wohnungslosigkeit und des Beraterkreises zur Sanierung der städtischen Unterkunftsanlagen.\n 2. Vorsitzende Mieterverein München e.V.\n\nSchwerpunkte: Wohnungs-, Sozial- und Gesundheitspolitik.\n\n	Erhalt preiswerten Wohnraums\n	Förderung Wohnungsneubau: ökologisch, behindertengerecht, bezahlbar.\n	Bedarfsgerechte soziale Infrastruktur\n	sozial- und umweltverträgliche Stadtentwicklung\n	Sicherstellung ausreichend pflegerischer Versorgung.\n', '', 'Walter, Gertraud', NULL, NULL, NULL),
(59, '1996-03-10', 'Geboren 1957 in Erlangen, drei Töchter, verheiratet.\nDiplom-Sozialpädagoge (FH).\nSeit 1976 in München.\nLangjährige Mitarbeit in einer Reihe sozialer Bewegungen. In der Münchner Kommunalpolitik aktiv seit 1984.\nMitglied des Stadtrates ? mit Unterbrechung ? seit 1993.\n\nSchwerpunkte:\n- Konzeptionelle Sozialpolitik - Armutsbekämpfung\n- Antidiskriminierungspolitik für MigrantInnen\n- Erhalt und Ausbau der kommunalen Flüchtlingspolitik\n- Demokratie und Recht\n- Kampf gegen Rechtsextremismus\n- Kulturpolitik, kulturelle Vielfalt erhalten\n- Aufbau des NS-Dokumentationszentrums.\n\nKorreferent des Sozialreferates.', '', 'Benker, Siegfried', NULL, NULL, NULL),
(60, '1996-03-10', 'Geboren am 17. Januar 1952 in München, drei Töchter. Seit 1984 im Stadtrat, von 1990-1996 als Dritte Bürgermeisterin, bin ich mit dem gesamten Spektrum der Stadtpolitik vertraut.Schwerpunkte der Stadtratsarbeit sind für mich die Sicherung und der Ausbau des ökologischen Niveaus und die Stärkung der Wirtschaftskraft, Vielfalt der Kulturen und Erhalt des sozialen Friedens durch Minderheitenschutz. Feministische Frauenpolitik werde ich weiter durchsetzen. ', '', 'Csampai, Sabine', NULL, NULL, NULL),
(62, '1996-03-10', 'Geboren am 11.2.1956 in München, verheiratet, vier erwachsene Kinder.\nAusbildung als Technische Zeichnerin, Abitur an der BOS für Technik und Gewerbe.\nLange tätig als Betreuerin für Asylbewerber und -bewerberinnen. Heute auf Honorarbasis beschäftigt als Bildungsbegleiterin für Migrantinnen.\nVon 1989 ? 1996 Mitglied des BA 11, seit 2002 erneutes Mandat.\n\nSchwerpunkte\n- Kinder- und Jugendpolitik,\n- Sozialpolitik,\n- Bildung / Sport,\n- Frauenpolitik,\n- Stärkung von bürgerschaftlichem Engagement und Selbsthilfegruppen, insbesondere Partizipation für Kinder und Jugendliche,\n- Unterstützung von Projekten für Minderheiten und Randgruppen.\n', 'http://www.jutta-koller.de/', 'Koller, Jutta', 'juttakoller', NULL, 'http://www.abgeordnetenwatch.de/jutta_koller-860-47158.html'),
(63, NULL, 'Ich bin gebürtiger Niederbayer, Jahrgang 1951, lebe seit 1968 in München und bin Vater von zwei erwachsenen Kindern.\n\nVor meiner Bürgermeister-Tätigkeit habe ich Sozialpädagogik und Politikwissenschaften studiert und war zuletzt Gesamtleiter der sozialen Einrichtungen im Schulzentrum München-Johanneskirchen.\n\n1990 wurde ich erstmals in den Münchener Stadtrat und am 2. Mai 1996, am 2. Mai 2002 sowie am 2.  Mai 2008 zum 3. Bürgermeister der Landeshauptstadt München gewählt.\n\nAls Stadtrat werde ich in den nächsten sechs Jahren schwerpunktmäßig die Themen Finanzen und Wirtschaft bearbeiten.', 'http://www.hepmonatzeder.de/', 'Monatzeder, Hep', NULL, NULL, 'http://www.abgeordnetenwatch.de/hep_monatzeder-860-47156.html'),
(64, '1990-03-18', 'Geboren im März 1959 in München, fünf Söhne. Schullbesuch in München, Abitur 1979. Abgeschlossenes Studium der Kunstgeschichte, Neueren und Mittelalterlichen Geschichte. 1984-90 Mitarbeiterin der GRÜNEN im Stadtrat für den Bereich Ökologie. Zur Zeit angestellt als wissenschaftliche Mitarbeiterin. Seit 1990 im Stadtrat. Schwerpunkte: Abfallwirtschaft, Energie, Umweltschutz, Gesundheit, Unterstützung der Interessen von Minderheiten. ', '', 'Schmalzl, Judith', NULL, NULL, NULL),
(65, '1994-06-12', 'Geboren am 27.11.1961 in Bocholt, Westfalen, verheiratet, zwei Kinder.\nStudium der Physikalischen Technik, Schwerpunkt Technischer Umweltschutz an der FH München.\n\nSeit 1994 im Rathaus.\n\nMitglied im Finanz-, Rechnungsprüfungs-, Stadtplanungs- und Bauordnungsausschuss.\n\nKommunalpolitische Schwerpunkte:\n- solide Finanzpolitik,\n- Erhalt bezahlbarer Wohnungen,\n- ökologische Stadtentwicklung und -planung.', '', 'Schwartz, Boris', NULL, NULL, NULL),
(66, '1990-03-18', 'Geboren am 26. September 1947 in Innsbruck, zwei Töchter, seit 1959 in München. Abitur, Diplom der TU München, Fachrichtung Architektur, ab 1979 freiberuflicher Architekt. Seit 1990 im Stadtrat. Mitglied im Stadtplanungs-, Kultur- und Riemausschuß und in der Kommission für Stadtgestaltung. Politische Schwerpunkte: Ökologische Stadtentwicklung, Stadtgestalt, Ausbau der öffentlichen Verkehrsmittel, Erhalt bezahlbarer Mietwohnung, Förderung neuer Wohnmodelle und Wohnformen, Unterstützung experimenteller Kunst. ', '', 'Steyrer, Helmut', NULL, NULL, NULL),
(67, '1978-03-05', 'Geboren am 18. Dezember 1939 in Heinsberg im Rheinland. Selbständige Kauffrau. Verheiratet, zwei erwachsene Söhne. Seit 1978 im Stadtrat. Mitglied im Riem-, Stadtplanungs- und Bauordnungs-, Gesundheits- und Krankenhaus-, Kommunal-, Finanz-, Verwaltungs- und Personalausschuß. Mein kommunalpolitisches Handeln ist geleitet von dem Ausspruch von Theodor Heuss:  Die Gemeinde ist wichtiger als der Staat - und das Wichtigste in der Gemeinde sind die Bürger.  ', '', 'Kaspar, Heidrun', NULL, NULL, NULL),
(68, '1990-03-18', 'Geboren am 17. Januar 1940 in Ungarn, freie Publizistin, zwei Kinder. Mitglied im Ausschuß für Arbeit und Wirtschaft, Sozialausschuß, Kulturausschuß, Schulausschuß, Sportausschuß. Mitglied der Stadtratskommission zur Gleichstellung der Frauen. Besondere Anliegen: Förderung des Mittelstandes, bürgerfreundliche Verwaltung, Föderung des Jugendsports, Gleichstellung von Frauen in allen Lebensbereichen. ', '', 'Roth, Brigitta', NULL, NULL, NULL),
(69, '1996-03-10', 'Geboren am 27.3.1961 in Bruchsal. Lebt in eingetragener schwuler Lebensgemeinschaft. Studium der katholischen Theologie, Germanistik, Philosophie in Heidelberg. Seit 1982 in München. 1989/90 erstes Staatsexamen. Durch Entzug der kirchlichen Lehrerlaubnis Ausbildungsverbot. Aufbaustudium in Literaturkritik. Seit 1991 Geschäftsführer der Münchner Aids-Hilfe e.V. 1990 bis 1996 im \nBezirksausschuss. Seit 1996 erster offen schwuler Stadtrat einer schwul-lesbischen WählerInnen-Initiative in Europa.\n\nPolitische Schwerpunkte:\n- Gleichstellungspolitik für Lesben, Schwule und Transgender,\n- zielgruppenspezifische Gesundheitsprävention,\n- Förderung kultureller Vielfalt, vor allem er Tanz-, Musik u. Literaturszene.\n\nMitglied im Kultur-, Gesundheits- und Kommunalausschuss, im Aufsichtsrat des Deutschen Theaters, im Beirat der Münchner Philharmoniker.', 'http://www.thomasniederbuehl.de/', 'Niederbühl, Thomas', NULL, NULL, 'http://www.abgeordnetenwatch.de/thomas_niederbuehl-860-47196.html'),
(70, '1996-03-10', 'In München am 31. Juli 1947 geboren, verheiratet, drei Kinder, Rechtsanwalt. Ehrenamtlicher Stadtrat von 1972 bis 1987 und seit 1996. ', '', 'Brunner , Manfred', NULL, NULL, NULL),
(71, '1990-03-18', 'Geboren am 12. Juli 1934 in München. Hochschulreife über den zweiten Bildungsweg. Studium der Wirtschafts- und Politikwissenschaften in München und Berlin.Langjährige berufliche Tätigkeit in Wirtschaft und Verwaltung sowie als Journalist. Mehrjährige Lehrtätigkeit an der Universität München und an der Hochschule für Politik in München. Seit 1990 im Stadtrat.Besondere Schwerpunkte in der Rathausarbeit sind Haushalt und Finanzen, Personal- und Wirtschaftsfragen sowie Bürgerkontakte jeglicher Art. ', '', 'Dr. Echtler, Ulrich', NULL, NULL, NULL),
(72, '1990-03-18', 'Geb. am 19. Juli 1950 in Hofgeismar. Abitur an der Albert-Schweitzer (Unesco-)Schule. Studium Jura, Politik und Psychologie. Seit 1971 in München, Rechtsanwalt, Journalist. Gründete 1986 die Umwelt- und Bürgerorganisation David gegen Goliath. Seit 1990 Stadtrat.Anliegen: Ich stehe für eine wertorientierte Politik der praktischen Vernunft und möchte gemäß dem DaCG-Motto  Wunder heute möglich machen  München zu einer kinder- und umweltfreundl. Solarstadt ohne Atom, mit autofreier Innenstadt, beispielhaftem Bürgerengagement und lebendiger Toleranz machen. ', '', 'Fricke, Bernhard', NULL, NULL, NULL),
(73, '1994-06-12', 'Geboren 26.1.1961 in Ludwigshafen/Rhein. Seit 1984 in München. Studium der BWL mit Schwerpunkten Marketing, Design und strategische Planung. Seit 1991 freiberuflich als Licht-Designer tätig. Seit 1994 im Stadtrat. Mitglied im Werk-, Stadtentwässerungs-, Bau-, Umweltschutz-, Kreisverwaltungs-, Sozialhilfe- und Kinder- und Jugendhilfeausschuß. Ziele im Rathaus: Individualität, Freiheit und Mobilität des Bürgers wahren. Verteidigung der Gewerbefreiheit gegen politische Bevormundung und überhöhte Steuern. Leitsatz: So wenig Staat wie möglich, so viel Staat wie nötig. ', '', 'Hanna, Thomas', NULL, NULL, NULL),
(74, '1994-06-12', '&nbsp;', '', 'Thanheiser, Sven', NULL, NULL, NULL),
(75, '1994-06-12', 'Geboren am 31. Januar 1939 in Amorbach. Verheiratet, ein Sohn. Abitur 1958, Studium: Germanistik, Philosophie, Anglistik, 1. u. 2. Staatsexamen, Magister Artium. Lehrerin für Deutsch und Englisch bis 1976.\nMitglied bei Mütter gegen Atomkraft, amnesty international, Greenpeace, IPPNW, Bund Naturschutz, Global Challenges Network und Attac.\nIm Bundeshauptausschuss der ödp. \n\nZiele: Erhaltung der natürlichen Lebensgrundlagen, weltweite soziale Gerechtigkeit, mehr Demokratie.\n\nSchwerpunkte:\n Erneuerbare Energien,\n Kreislaufwirtschaft,\n Öffentlicher Personennahverkehr,\n attraktives, kompaktes Bauen durch Terrassenreihenhäuser,\n Abbau der Verschuldung der Stadt.\n\nMitglied im Ausschuss für Arbeit- und Wirtschaft, im Kommunal-, Sozial- und Umweltschutzausschuss.', '', 'von Walter, Mechthild', NULL, NULL, NULL),
(76, '1993-09-17', 'Geboren am 21. März 1940 in München, verheiratet, drei erwachsene Kinder, drei Enkelkinder.\n\nAbitur am städtischen Elsa-Brändström-Gymnasium in München-Pasing. Studium der Germanistik, Altphilologie und Geschichte in München und Wien. Abschluss mit der Promotion zum Dr. phil. an der Ludwig-Maximilians-Universität München.\n\nVon 1967 bis 1990 neben der Hausfrauentätigkeit vor allem ehrenamtlich tätig (20 Jahre Bezirksausschuss, 14 Jahre Elternbeirat, 10 Jahre Adoptionsvermittlung für das Kinderhilfswerk Terre des hommes). \n\nVon 1990 bis September 1993 ehrenamtliche Stadträtin, Korreferentin des Schulreferats, stellvertretende Vorsitzende der SPD-Stadtratsfraktion.\n\nAm 17. September 1993, am 29. Juni 1994 und erneut am 2. Mai 1996 und erneut am 2. Mai 2002 zur 2. Bürgermeisterin gewählt, zuständig für die Sozialausschüsse, die Ausschüsse für Schule und Sport, den Kommunalausschuss, für Bürgerangelegenheiten und die Bezirksausschüsse, Aufsichtsratsvorsitzende der Münchner Tierpark\nHellabrunn AG und der MÜNCHENSTIFT GmbH.\n\nZielsetzung:\n"Trotz aller Sparzwänge werde ich mich mit aller Kraft dafür einsetzen, den sozialen Frieden in unserer Stadt zu erhalten.\nDazu gehört auch, dass wir unserer Jugend genügend Bildungs- und Berufschancen anbieten können. Ich trete für ein kinder- und\nfamilienfreundliches Klima und ein Miteinander der Generationen in unserer Stadt ein. Vielfältige Angebote für die ältere Generation sollen ihr die Möglichkeit eines selbstbestimmten würdigen Lebens im Alter eröffnen.\n\nZudem muß die Verwaltungsreform weiter vorangetrieben werden, damit unsere Stadt noch bürgernäher und in ihren Maßnahmen noch transparenter wird."\n\nBis 31.12.2005 2. Bürgermeisterin.', '', 'Dr. Burkert, Gertraud', NULL, NULL, NULL),
(77, '1978-03-05', 'Geboren am 1. Februar 1938 in Weilheim. Verheiratet, drei Töchter.\nSeit 1954 in München als Stadtpfarrmesner in der Pfarrei St Rupert auf der Schwanthalerhöhe.\nSeit 1978 im Stadtrat.\nKommunalpolitische Ziele: Stadtteilsanierung mit Modernisierung und Neubau von familien- und altengerechten Wohnungen, bessere Versorgung älterer Bürger durch ambulante Dienste und Altenservicezentren. Erhaltung von Kleinbetrieben und qualifizierten Arbeitsplätzen. Versorgung mit Schulen; Verkehrsplanung. Erhaltung der Münchner Innenstadt als Wohngebiet.', '', 'Ilg, Hugo', NULL, NULL, NULL),
(78, '1978-03-05', 'Geboren 1929 in München. Verheiratet, vier Kinder. Abitur, Schriftsetzer-Lehrmeister, werbefachl. Abendstudium.\nSeit 1978 e.a. Stadtrat. Mitglied der Ausschüsse für Wirtschaft, Stadtplanung und Riem. Wirtschaftspolitischer Sprecher der CSU-Fraktion.\nKommunalpolitische Ziele: Förderung des mittelständischen Handels und Handwerks sowie einer guten Berufsausbildung - Bau und Erhaltung von preisgünstigem Wohnraum - Förderung eines sinnvollen Umweltschutzes.', '', 'Schottenheim, Albert', NULL, NULL, NULL),
(79, '1978-03-05', 'Geboren am 29. März 1921 in München. Verheiratet. 1948 Meisterprüfung im Schlosserhandwerk, 1959 Übernahme des väterlichen Stahl- und Metallbaubetriebs.\nEhrenobermeister der Metall-\nInnung München. Langjähriger Ortsbeauftragter des THW München.\n\nSeit 1972 Stadtrat.\n\nMitglied im Bau- und Kreisverwaltungsausschuss.\n\nSchwerpunkte meiner Stadtratsarbeit:\n&#8226;	Erhaltung der Münchner Wirtschaftskraft,\n&#8226;	Stadtviertelarbeit,\n&#8226;	Hilfe für sozial Schwache,\n&#8226;	Förderung der Rettungsdienste.\n&#8226;	Oberstes Ziel: &#8222;Die sozial Schwächeren bedürfen der Hilfe des wirtschaftlich Stärkeren.&#8221;\n', '', 'Hierl, Rudolf', NULL, NULL, NULL),
(80, '1990-03-18', 'Stadtrat seit 1990. Geboren am 23. April 1932 in München, r. k., verheiratet, zwei Töchter, selbst. Dipl.lng.(FH); technische Gebäudeausrüstung; stellvertr. Bezirksvorsitzender der AGM-Arbeitsgemeinschaft Mittelstand der CSU-München; Sprecher der CSU im Riemausschuß, Mitglied im Bauausschuß, Werkausschuß und Stadtplanungsausschuß, Energiekommission.\nSchwerpunkte: Mittelstandsförderung, Erhalt der Münchner Wirtschaftskraft, Wohnungsbau, Energieversorgung, Förderung kultureller Belange.', '', 'Winklmaier, Friedrich', NULL, NULL, NULL),
(216, '2002-03-03', 'Geb. 16.09.1963 in Samsun/Türkei, seit 1970 in Deutschland, verheiratet.\n1993 Abschluß des Studiengangs Verwaltungswissenschaften an der Uni Konstanz,\n1983-1996 Sozialberaterin für MigrantInnen bei der AWO München,\n1996-2002 sozial- und migrationspolitische Referentin der Stadtratsfraktion Bündinis 90/Die Grünen, zudem seit 1997 als Interkulturelle Familienberaterin tätig.\n\nBesondere Anliegen:\n	Multikulturelle Stadtgesellschaft auf allen Ebenen\n	verbesserte Bildungschancen für junge MigrantInnen\n	menschenwürdiges Leben für ausländische Senioren\n	ausreichend Wohnraum für sozial Schwache\n	kulturelle Vielfalt in der Jugendarbeit\n\nMitglied im Sozial-, Bau-, Kinder- und Jugendhilfe- und Kommunalausschuss.\n', '', 'Özakin, Sedef', NULL, NULL, NULL);
INSERT INTO `stadtraetInnen` (`id`, `gewaehlt_am`, `bio`, `web`, `name`, `twitter`, `facebook`, `abgeordnetenwatch`) VALUES
(219, NULL, 'Geboren am 24. April 1936 in München. Verwitwet, vier Kinder. Volksschule, Mittelschule, kaufmännische Lehre als Verkäuferin. Seit 1972 im Stadtrat. Schwerpunkte: Werkbereich, öffentlicher Nahverkehr sowie Schul- und Bildungswesen, ausreichende Kindergartenplätze, Förderung des Freizeit- und Vereinssports. Enger Kontakt mit Bürgern und Bezirksausschüssen. Schul- und sportpolitische Sprecherin und stellvertretende Vorsitzende der SPD-Stadtratsfraktion. ', '', 'Nindl, Maria', NULL, NULL, NULL),
