(183598, '2002-03-03', 'Geboren 1954, verheiratet, zwei erwachsene Kinder, Polizeibeamter.\nFraktionsvorsitzender.\nStadtrat der FREIEN WÄHLER.\nMitglied im Bau- und Stadtentwässerungs-, Planungs- und Kommunalausschuss sowie im Ältestenrat, im Bayerischen Städtetag, im Kulturausschuss des Dt. Städtetags, in der Bauleitkommission und im Regionalen Planungsverband. Aufsichtsrat der MVHS. Verwaltungsbeirat Direktorium und Rechtsabteilung.\n\nKommunalpolitische Ziele:\n- kreuzungsfreier Ausbau des Mittleren Rings durch vier Tunnel (Tunnel auch für den Innsbrucker Ring)\n- verträgliche Nachverdichtung im Wohnungsbau u.a. durch Punkt-Hochhäuser\n- sinnvoller Ausbau und Modernisierung des ÖPNV statt Prestigeprojekt 2. Stammstrecke\n- Ausbau des Bürgerservices', 'http://johann-altmann.de/', 'Altmann, Johann', NULL, 'JohannAltmannStadtratMuenchen', 'http://www.abgeordnetenwatch.de/johann_altmann-860-47194.html'),
(183599, '2002-03-03', 'Geboren am 2.7.1973 in München, Diplom-Volkswirt, Doktor oec. publ.,\n\nPolitische Ziele:\n zukunftsgerichtete Finanzpolitik,\n witschaftsfreundliche Kommunalpolitik,\n München fit machen für den globalen Wettbewerb,\n Erhalt christlicher Werte in der Politik.', '', 'Dr. Baretti, Christian', NULL, NULL, NULL),
(183600, '2002-03-03', 'Geboren am 6.12.1970 in München, selbständiger\n                 Rechtsanwalt. \n\n                 Mitglied im Bau- und im Kulturausschuss,\n                 Kreisvorsitzender der CSU München Süd.\n\n                 Kommunalpolitische Ziele:\n\n                   Schaffung besserer Investitionsbedingungen;\n\n                   verstärkter Bau leistungsfähiger Verkehrswege\n                   wie die Untertunnelung des Mittleren Rings,\n                   genug Parkplätze und attraktiver Ausbau des\n                   MVV; \n\n                   Abbau von Bürokratie;\n\n                   respekt- und rücksichtsvolles Miteinander der\n                   Generationen;\n\n                   Förderung von Kunst und Kultur sowie Pflege\n                   Bayerischer Bräuche und Traditionen.', '', 'Eisenreich, Georg', NULL, NULL, NULL),
(183601, '2002-03-03', '36 Jahre, katholisch, Unternehmer, Vorsitzender der CSU Freimann.\nMitglied im Verwaltungs- und Personalausschuss, im Finanzausschuss, im Kinder- und Jugendhilfeausschuss sowie im Bauausschuss.\nWeltoffen, lebenswert und freundlich: So sieht Guido Gast die Zukunft von München.\n\nSchwerpunkte seiner politischen Arbeit:\n Förderung der Erfolgsaussichten von kleinen und mittelständischen Unternehmen\n Sicherung vorhandener Arbeitsplätze und Schaffung neuer Beschäftigungsverhältnisse\n Für eine lebendige Jugendkulturszene\n Für mehr städtische Dienstleistungen am Bürger', '', 'Gast, Guido', NULL, NULL, NULL),
(183602, '2002-03-03', 'Geb. 1948 in München. Dort Studium der BWL. Verheiratet, zwei Kinder.\nMittelständler in der Wohnungswirtschaft. \nMitglied im Vorstand der IKG München und Oberbayern.\nVorsitzender des politischen Beirats für das NS-Dokumentationszentrum.\nMitglied im Kinder- und Jugendhilfe-, Kultur- und Sozialausschuss. \nSozial- und energiepolitischer Sprecher.\n\nZiele:\n- Familiengerechter Wohnungsbau mit erschwinglichen Mieten.\n- Zusätzliche Kinderkrippen, Kindergärten, Horte.\n- München als kinderfreundliche Stadt.\n- Erhalt des sozialen Gleichgewichts.\n- Senkung der Energiepreise durch die SWM.\n- Respekt und Anerkennung für die ältere Generation.\n- München muss Kulturhauptstadt bleiben.', '', 'Offman, Marian', NULL, NULL, 'http://www.abgeordnetenwatch.de/marian_offman-860-47180.html'),
(183603, '2002-03-03', 'Geboren am 7. September 1975 in München, röm.-kath., verheiratet, ein Sohn, Diplom-Kaufmann.\n\nSeit 2002 im Stadtrat.\nStv. Fraktionsvorsitzender.\nMitglied im Ausschuss für Arbeit und Wirtschaft, Kreisverwaltungs- und Sozialausschuss. Wirtschafts- und umweltpolitischer Sprecher. \nKorreferent im Wirtschaftsreferat.\nMitglied im Ausschuss für Wirtschaft und Europa des Deutschen Städtetages. \nMitglied im Aufsichtsrat der Stadtwerke München GmbH.\n\nPolitische Ziele:\n- Förderung der Wirtschaft, insbesondere des Mittelstandes in München\n- mehr Bürgerfreundlichkeit in der Verwaltung\n- Schaffung von bezahlbarem Wohnraum, vor allem für Familien.', '', 'Pretzl, Manuel', NULL, NULL, 'http://www.abgeordnetenwatch.de/manuel_pretzl-860-47169.html'),
(183604, '2002-03-03', 'Geb. am 27.9.1969 als Handwerkersohn in München, verheiratet, zwei Kinder, Wehrdienst, Diplom-Kaufmann und Rechtsanwalt. Partner einer überörtlichen RA-Sozietät.\n\nVorsitzender der CSU-Stadtratsfraktion, Mitglied im Ausschuss für Stadtplanung und Bauordnung und im Ausschuss für Bildung und Sport.\nVorsitzender der CSU-München-West, stv. Vorsitzender der CSU München, Mitglied im CSU-Parteivorstand.\n\nPolitische Schwerpunkte:\n- Umwelt- und verbraucherfreundliche Politik für die Münchnerinnen und Münchner,\n- beste (Aus-)Bildung für unsere Kinder und Jugendlichen,\n- wirtschafts- und mittelstandsfreundliche Politik für sichere Arbeitsplätze.', 'http://www.josef-schmid.info/', 'Schmid, Josef', NULL, 'josefschmid2014', 'http://www.abgeordnetenwatch.de/josef_schmid-860-47171.html'),
(183605, '2002-03-03', '&nbsp;', '', 'Schmucker, Elisabeth', NULL, NULL, 'http://www.abgeordnetenwatch.de/elisabeth_schmucker-860-47177.html'),
(183606, '2002-03-03', 'Geboren am 11.7.1954 in Großgundertshausen/Mainburg. Verheiratet, drei Kinder.\n\nSeit 1974 in München, selbständiger Rechtsanwalt.\n\nSeit 1987 im Bezirksausschuss Hadern, seit 1996 dessen Vorsitzender. Stadtrat seit 2002. \n\nMitglied im Ausschuss für Stadtplanung und Bauordnung, Kommunal- und Sozialausschuss.\n\nBesondere Anliegen:\n- ausgewogene und sparsame Finanzpolitik\n- Stadtentwicklung\n- Vereinsförderung\n- Stadtviertelarbeit\n- sinnvolle Verkehrspolitik.', '', 'Stadler, Johann', NULL, NULL, 'http://www.abgeordnetenwatch.de/johann_stadler-860-47176.html'),
(183607, '2002-03-03', 'Geb. 1960 im Lkrs. Landshut, verh., eine Tochter, ein Sohn. 5-jährige Tätigkeit in der Finanzverwaltung, Abitur auf dem 2. Bildungsweg, Jurastudium, Referendariat, Volljurist. Assessor bei einer bayerischen Großbank. \nMitglied im Sozial-, Kinder- und Jugendhilfeausschuss und Ausschuss für Arbeit und Wirtschaft. Sprecher im Kinder- und Jugendhilfeausschuss. Verwaltungsbeirat für Wirtschaftsförderung und für Sozialhilfe.\n\nKommunalpolitische Schwerpunkte:\n- Förderung des Wirtschaftsstandorts München\n- Förderung mittelständischer Unternehmen und Jungunternehmer\n- Schaffung neuer Arbeitsplätze\n- Mehr Kindergarten-, Kinderkrippen- und Hortplätze\n- mehr Wohnungsbau zu sozialverträglichen, bezahlbaren Mieten\n- Mehr Sicherheit an Schulen und auf Schulwegen ', '', 'Straßer, Max', NULL, NULL, NULL),
(183608, '2002-03-03', 'Geboren 1976, Rechtsanwalt.\nStadtrat seit 2002.\nKorreferent des Personal- und Organisationsreferates, Sprecher im Ausschuss\nfür Stadtplanung und Bauordnung, Mitglied des Verwaltungsund\nPersonalausschuss und der Bauleitplankommission, Aufsichtsrat der Wohnungsbaugesellschaften GEWOFAG, HEIMAG und der Münchner Gesellschaft für Stadterneuerung (MGS).\n\nMeine Ziele:\n- Förderung des Wohnungsbaus, preiswerten Wohnraums\n- Schaffung von wohnortnahem Einzelhandel\n- sichere Rad- und Fußwege\n- die Stadt ist ein sozialer Arbeitgeber mit sicheren und modernen Arbeitsplätzen und motivierten städtischen Mitarbeiter(-innen)\n- Einführung von LIMUX', '', 'Amlong, Christian', NULL, NULL, 'http://www.abgeordnetenwatch.de/christian_amlong-860-47198.html'),
(183609, '2002-03-03', 'Geboren am 24.12.1958 in München röm-kath., Leitender Feuerwehrnotarzt, Notfallmedizin, Katastrophenmanagement, ärztlicher Leiter der Laiendefibrillationsprogramme der Landeshauptstadt München.\nMitglied im Gesundheits-, Finanz- und Kulturausschuss, im Sozial-, Kinder- und Jugendhilfe und Rechnungsprüfungsausschuss. Sitz im Aufsichtsrat der Münchenstift gGmbH, im Rettungszweckverband, Behindertenbeirat und der BA-Satzungskommission sowie im Verwaltungsbeirat des Vermessungsamtes und in der Taxikommission.\n\nZiele:\n- Verbesserungs des Notfall- und Katastrophenmanagements zum Schutze der Menschen in unserer Stadt.\n- Gleichzeitig unterstütze ich eine soziale und umweltfreundliche Weiterentwicklung der Stadt.', '', 'Dr. Assal, Josef', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_josef_assal-860-47200.html'),
(183610, '2002-03-03', '&nbsp;', '', 'Belik, Oliver', NULL, NULL, 'http://www.abgeordnetenwatch.de/oliver_belik-860-47202.html'),
(183611, '2002-03-03', 'Geboren 1970 in München, verheiratet, zwei Kinder (Jahrg. 2008 und 2010), Dipl.-Ingenieurin für Landschaftsplanung (FH) und Dipl.-Geographin (TU). Stadträtin seit 2002.\n\nMitglied des Ausschuss für Stadtplanung und Bauordnung, des Kommunal- und des Umweltausschuss, der Gleichstellungskommission, der Kommission Europa und des Aufsichtsrats der Olympiapark GmbH.\n\nIch setze mich ein für\n- die Sicherung der Lebensqualität in einer wachsenden Stadt, u.a. durch Erhalt von bezahlbarem Wohnraum und Sicherung von Grün- und Freiflächen.\n- fortschrittliche Frauenpolitik.\n- städtische Betriebe in städtischer Hand und die Stärkung kommunaler Dienstleistungen im EU Binnenmarkt.\n\n\nSiehe auch ulrike-boesser.de', 'http://www.ulrike-boesser.de/', 'Boesser, Ulrike', NULL, NULL, 'http://www.abgeordnetenwatch.de/ulrike_boesser-860-47203.html'),
(183612, '2002-03-03', '&nbsp;', 'http://www.gradl.de/', 'Gradl, Nikolaus', 'stadtrat_gradl', 'gradl', 'http://www.abgeordnetenwatch.de/nikolaus_gradl-860-47207.html'),
(183613, '2002-03-03', '&nbsp;', '', 'Leonhart, Michael', NULL, NULL, 'http://www.abgeordnetenwatch.de/michael_leonhart-860-47210.html'),
(183614, '2002-03-03', 'Geboren am 6.11.1967 in Passau, seit 1968 in München; Abitur am Städt. Werner-von-Siemens-Gymnasium, Medizinstudium an der Ludwig-Maximilians-Universität München.\nSeit 2000 an verschiedenen Krankenhäusern der Stadt München als Arzt tätig.\n\n1994 - 2002 Mitglied im Bezirksausschuss Trudering-Riem, seit 2002 im Stadtrat.\n\nMitglied im Gesundheits-, Umweltschutz- und Planungsausschuss.\nGesundheits- und verkehrspolitischer Sprecher der SPD-Fraktion\n\nPolitische Schwerpunkte:\n- Gesundheits-, Umwelt- und Verkehrspolitik\n- Förderung von Ehrenamt und Breitensport.', '', 'Dr. Mittermaier, Ingo', NULL, NULL, 'http://www.abgeordnetenwatch.de/ingo_mittermaier-860-47214.html'),
(183615, '2002-03-03', 'Geboren am 11. Januar 1964 in Völklingen/Saar. \nVater von drei erwachsenen Kindern. \nSeit 1985 in München.\nKrankenpfleger, Pflegemanagementweiterbildung. Beschäftigt im Städtischen Klinikum München seit 1985.\n\nMitglied im Kulturausschuss, Finanzausschuss, im Ausschuss für Arbeit und Wirtschaft sowie im Umweltausschuss. \n\nAufsichtsrat Deutsches Theater München Betriebsgesellschaft mbH und Gasteig München GmbH.\n\nMitglied im Hauptausschuss Bayerischer Städtetag, Gesundheitsausschuss Deutscher Städtetag und Kulturausschuss Bayerischer Städtetag. \n\nKulturpolitischer Sprecher der SPD-Fraktion.', '', 'Rupp, Klaus Peter', NULL, NULL, 'http://www.abgeordnetenwatch.de/klaus_peter_rupp-860-47219.html'),
(183616, '2002-03-03', '&nbsp;', 'http://www.ireneschmitt.de/', 'Schmitt, Irene', NULL, NULL, 'http://www.abgeordnetenwatch.de/irene_schmitt-860-47223.html'),
(183617, '2002-03-03', 'Geb. am 20. März 1963, Mutter von 2 Kindern. Beraterin für Erziehung, Bildung, Sport. Seit Mai 2002 im Stadtrat. Korreferentin im Schul- und Kultusreferat.\nMitglied im Fraktionsvorstand. Sprecherin im Bildungs- und Sportausschuss,\nMitglied im Kinder- und Jugendhilfeausschuss. Mitglied in den Aufsichtsräten\nder Olympiapark München GmbH und der Münchner Volkshochschule.\n\nMeine kommunalpolitischen Ziele:\n Gleiche Bildungschancen für alle,\n Vereinbarkeit von Familie und Beruf\n Stärkung des Breiten-, Schul- u. Vereinssports, Förderung von Trendsportarten\n Unterstützung der Bewerbung Münchens um die Olympischen und Paralympischen Winterspiele 2018\n Angebote, Beratung und Hilfe für Senioren.\n\nNur wer sich im sozialen Netz sicher fühlt, ist auch bereit sich für die Gesellschaft\nzu engagieren.', '', 'Stachowitz, Diana', NULL, NULL, NULL),
(183618, '2002-03-03', 'Geboren am 17.10.1959 in Gleiwitz.\nVerheiratet, drei Kinder. Seit Anfang der 80er in München. Jurastudium in Passau, München, Lausanne. In eigener Kanzlei als Rechtsanwältin tätig. Vorsitzende des Mietervereins München und des Bayr. Mieterbundes. \nMitglied im Finanz-, Kreisverwaltungs-, Rechnungsprüfungs- und Bildungs- und Sportausschuss.\nVorsitzende des Rechnungsprüfungsausschusses.\n\nZiele: Ich möchte insbesondere daran mitarbeiten,\n- dass München eine sichere, lebendige Stadt, für Einzelne und auch für Familien mit Kindern sowie ein attraktiver Wirtschaftsstandort ist,\n- dass die Stadt weiterhin für Familien Zeichen setzt bei der Vereinbarkeit von Familie, Kindern und Beruf und der Sport seinen Platz in der Stadt hat. \n- dass München seine finanzielle Handlungsfähigkeit behält, um seine vielfältigen Aufgaben zu erfüllen.', 'http://beatrixzurek.mux.de/', 'Zurek, Beatrix', NULL, NULL, 'http://www.abgeordnetenwatch.de/beatrix_zurek-860-47230.html'),
(183619, '2002-03-03', 'Geboren am 20.10.1960 in Polch (Rheinland-Pfalz). Seit 1986 in München lebend.\nKrankenschwester, Abitur auf dem zweiten Bildungsweg, Studium der Politischen Wissenschaften, Sozialpsychologie und Recht für Sozialwissenschaftler. Mitarbeit in Bürgerinitiativen, 3 Jahre Vorsitzende der Grünen München, seit 2002 im Stadtrat.\n\nSchwerpunkte:\n- Frauen- und Genderpolitik,\n- Gesundheit und Krankenhäuser, Beschäftigung und Kommunale Daseinsvorsorge,\n- Gleichstellung von Lesben und Schwulen.\n- München in Europa Mitglied im Ausschuss für Arbeit und Wirtschaft, Gesundheits- und Verwaltungs- und Personalausschuss.\n\nMitglied der Gleichstellungskommission, im Aufsichtsrat des Städtischen Klinikums.', 'http://www.lydia-dietrich.de/', 'Dietrich, Lydia', NULL, NULL, 'http://www.abgeordnetenwatch.de/lydia_dietrich-860-47161.html'),
(183620, '2002-03-03', 'Geboren am 31.10.1957 in München, verheiratet, 2 Töchter. 1. und 2. Staatsexamen für Lehramt an Gymnasien (Sport, Sozialkunde, Erdkunde), PRReferentin und Journalistin. Mitglied in verschiedenen Umweltverbänden, 8 Jahre im BA 3 Maxvorstadt. Seit 2002 im Stadtrat.\n\nSchwerpunkte: \nMehr Chancengerechtigkeit, mehr Autonomie der Schulen, Ausbau rhythmisierter Ganztagsschulen, Hochenergetischer Wohnungsneubau und Sanierung, Erhalt von Grün-, Frei- und Naturschutzflächen bei der Nachverdichtung, Natur- und Biotopschutz, Ausbau Erneuerbarer Energien, Energieeinsparung und -effizienz, Ernährung ? mehr Bio, mehr fair gehandelte Lebensmittel, weniger Fleisch.\n\nMitglied im Bildungs-, Sport-, Bau-, und Umweltausschuss, im Aufsichtsrat der SWM, in der Energiekommission.  Korreferentin des Referates für Gesundheit und Umwelt.', 'http://www.sabine-krieger.de/', 'Krieger, Sabine', NULL, NULL, 'http://www.abgeordnetenwatch.de/sabine_krieger-860-47160.html'),
(183621, '2002-03-03', 'Geboren am 09.08.1971 in München, eine Tochter, Bauingenieur.\n\nMein Ziel ist die energie- und verkehrspolitische Wende für München: frische Luft, weniger Lärm, mehr Grün. Die Stadt München erfüllt ihre ehrgeizigen Ziele im Klimaschutz und gewinnt deutlich an Wohn- und Lebensqualität.\n\nIm Stadtrat seit 2002.\n\nVerkehrspolitischer Sprecher der Fraktion. Mitglied im Stadtplanungs- und Bauordnungsausschuss, Ausschuss für Arbeit und Wirtschaft, Bau- und Umweltschutzausschuss.\n\nSchwerpunkte:\n	Nachhaltige Verkehrs- und Stadtgestaltungspolitik\n	Klimaschutzpolitik\n	Umweltschutzpolitik\n', '', 'Mühlhaus, Jens', NULL, NULL, NULL),
(183622, '2002-03-03', 'Geboren am 13. Juli 1978 in München, ledig. \nAbitur am Edith-Stein-Gymnasium, Diplom Psychologin, Doktorandin an der LMU.\nStellv. Fraktionsvorsitzende. Seit 2002 im Stadtrat. Mitglied im Kinder- u. Jugendhilfe-, Schul- u. Sport-, Sozial- und Kreisverwaltungsausschuss.\nMitglied der Stadtratskommission zur Gleichstellung der Frauen.\n\nSchwerpunkte:\n Gewährleistung der Bürgerrechte in einem offenen, liberalen München\n Fördern und Fordern  individuelle und vielseitige Bildungsangebote für alle, unabhängig von der Herkunft\n Vereinbarkeit von Familie und Beruf\n Vertretung der Interessen und Bedürfnisse der jungen Generationen\n Förderung des Tierschutzes in München.', '', 'Hirsch, Nadja', NULL, NULL, NULL),
(183623, '2002-03-03', 'Geboren 1957, eine erwachsene Tochter, Verwaltungswirtin; stellv. Fraktionsvorsitzende, Korreferentin im Referat für Bildung und Sport. \nAusschüsse: Arbeit und Wirtschafts-, Bildungs-, Kommunalausschuss, Mitglied im Bayerischen und Deutschen Städtetag, Verwaltungsbeirätin München Tourismus\n\nMein Motto: Nach uns nicht die Sintflut, sondern unsere Kinder. \n\nSchwerpunkte:\n- Wirtschaftspolitik mit dem Ziel, den sozialen Frieden in München zu erhalten, um ein gutes Zusammenleben aller Generationen zu ermöglichen.\n- Finanzpolitik mit dem Ziel, Schulden zu reduzieren und  Neuverschuldungen zu vermeiden, um die Daseinsvorsorge für künftige Generationen zu gewährleisten.', '', 'Neff, Gabriele', NULL, NULL, 'http://www.abgeordnetenwatch.de/gabriele_neff-860-47190.html'),
(183624, '2002-03-03', '&nbsp;', 'http://www.christastock.de/', 'Stock, Christa', NULL, NULL, 'http://www.abgeordnetenwatch.de/christa_stock-860-47189.html'),
(183625, '2002-03-03', '1939 in Deggendorf a.d. Donau geboren, Diplom-Ing. (FH), verheiratet, 2 Kinder.\n1960-1963 Ingenieurstudium (Maschinenbau) in München am damaligen Oscar-v.-Miller-Polytechnicum (heute FH). 1963-1969 Projektleiter im umwelttechnischen Anlagenbau. Seit 1970 Inhaber eines Münchner Handwerksbetriebes. 1992-1994 Mitglied im BA 21 Pasing.\nMeine besonderen Anliegen:\n- Förderung und Unterstützung insbesondere der einheimischen kleinen    \n  mittelständischen Betriebe.\n- Rückbesinnung auf nationale Belange zur Sicherung der sozialen \n  Gerechtigkeit.\n- Betonung von Recht und Ordnung als Voraussetzung für ein urbanes und\n  humanes Zusammenleben.\n\nVerstorben am: 08.07.2005', '', 'Weinfurtner, Johann', NULL, NULL, NULL),
(183626, '2002-03-03', 'Geb. 1962 in Augsburg. Dipl.-Informatikerin, 1981-1987 Studium an der TU München. Seither Softwareentwicklerin in Teilzeit. Engagiert in Studentenvertretung und außerparlamentarischen Bewegungen: Friedens- und Anti-Atom-Bewegung, Kurdistan-Solidarität. 1995 Eintritt in die PDS, seit 2007 Mitglied der LINKEN. Sprecherin der ArGe Konkrete Demokratie, Soziale Befreiung. Mitglied von ver.di, Betriebsratsvorsitzende. Mitherausgeberin der ?Politischen Berichte?. Mitarbeit in der Redaktion der ?Münchner Lokalberichte?; Vorsitzende des Forum Linke Kommunalpolitik München e.V. \n\nSchwerpunkte seit 2002 im Stadtrat:\n- Demokratisierung und Dezentralisierung auf kommunaler Ebene\n- Soziale oder rechtliche Ausgrenzung bekämpfen\n- Widerstand und Kritik aus der Gesellschaft aufgreifen\n- Stadt- und Regionalplanung sozial gestalten', '', 'Wolf, Brigitte', NULL, NULL, 'http://www.abgeordnetenwatch.de/brigitte_wolf-860-47188.html'),
(183720, '2002-03-03', '&nbsp;', '', 'Fincan, Ömer-Yasar', NULL, NULL, 'http://www.abgeordnetenwatch.de/yasar_fincan-860-47205.html'),
(183886, '2002-03-03', 'Geboren am 31. März 1967. Seit vielen Jahren ehrenamtlich für Münchner Kinder und Jugendliche engagiert. Beruflich als Sozialarbeiter im Kindertagesstättenbereich beschäftigt. Engagiertes Mitglied der katholischen Kirche. \n2. stellv. Vorsitzender des Bezirksausschusses 21 Pasing-Obermenzing. Kinder-, jugend- und sozialpolitischer Sprecher der SPD-Fraktion. Korreferent des Sozialreferats.\n\nSetzt sich besonders ein für:\n- Eine Politik für Kinder, Jugendliche und Familien in München über alle Fachbereiche hinweg,\n- Ein soziales München und das Miteinander der Generationen und der Münchnerinnen und Münchner verschiedener kultureller Herkunft,\n- Gute Sportanlagen für die Münchner Sportvereine - insbesondere für den Kinder- und Jugendsport\n- Den raschen Neubau vieler erschwinglicher Wohnungen.', '', 'Müller, Christian', NULL, NULL, 'http://www.abgeordnetenwatch.de/christian_mueller-860-47215.html'),
