(1092087, NULL, '1938 in Würzburg geboren, vier Kinder, seit 1956 in München, röm-kath., pens. Kriminalbeamter, zuletzt Leiter SOKO Korruptionsbekämpfung, Diplomverwaltungswirt (FH).\nGeschäftsführer der Goethe-Gesellschaft München. \nSeit 1998 Seniorenstudium in Germanistik, Philosophie und Geschichtswissenschaft. Sänger im Chor der Polizei München. \nSeit 1984 im BA 13, Bogenhausen, dort Fraktionssprecher der CSU und Leiter des Umweltausschusses.\n\nMitglied im Bau- und im Umweltschutzausschuss.\n\nSchwerpunkte:\n	Umweltpolitik\n	Förderung der Kultur\n	Für Bürokratieabbau\n	Gegen Korruption\n	Gegen Verharmlosung sogenannter leichter Drogen', '', 'Brendel, Hans', NULL, NULL, NULL),
