(1290786, NULL, 'Geboren am 20.09.1974, verheiratet,\nzwei Kinder, Studium der Politikwissenschaften, Medien- und Kommunalrecht sowie Soziologie. Abschluss: Politologe M.A. Beruf: Wissenschaftlicher Mitarbeiter (derzeit in Elternzeit). \nStadtratsmitglied seit Oktober 2007. Mitglied im Bauausschuss und im Kommunalausschuss. Mitglied der BA-Satzungskommission, stv. Vorsitzender im Bezirksausschuss 14, Berg am Laim.\n\nSchwerpunkte\n Stadtplanung und -entwicklung\n(Verkehr, Wohnen, Umwelt,\nLebensqualität),\n Schule und Bildung (bessere\nBildung und mehr Bildungsgerechtigkeit),\n Familie, Kinder und Jugendliche\n(Kinderbetreuung, kinder- und\njugendfreundlichere Stadt).', '', 'Kulzer, Robert', NULL, NULL, NULL),
