(1418504, '2008-03-02', '&nbsp;', 'http://www.georg-kronawitter.de/1952/index.html', 'Dr. Kronawitter, Georg', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_georg_kronawitter-860-47163.html'),
(1418507, '2008-03-02', 'Geboren am 16. März 1972 in München. Rechtsanwalt. Vorsitzender der CSU-Forstenried/Fürstenried; Mitglied des Bezirksvorstandes der CSU München. BRK-Kreisvorsitzender.\n\nStadtrat seit 2008, stv. Fraktionsvorsitzender der CSU. Korreferent der Stadtkämmerei.  Finanzpolitischer und verkehrspolitischer Sprecher, stv. Sprecher für Stadtplanung und Bauordnung, Mitglied im Planungs-, Kreisverwaltungs-, Finanzund Rechnungsprüfungsausschuss.\n\nPolitische Schwerpunkte:\n- Wohn- und Lebensqualität, Stadtbild\n- Neue Bürgerbeteiligungskultur\n- Nachhaltige kommunale Finanzpolitik\n- Leistungsstarkes Rettungswesen\n- Kampf gegen Rechtsextremismus', 'http://www.michael-kuffer.de/', 'Kuffer, Michael', NULL, 'michael.kuffer', 'http://www.abgeordnetenwatch.de/michael_kuffer-860-47167.html'),
(1418509, '2008-03-02', 'Geboren 1971 in München, evangelisch, verheiratet, eine Tochter.\nAbitur am Münchner Elsa-Brändström-Gymnasium, Studium und Promotion an der LMU München in Kommunikationswissenschaft, BWL und Jura.\nBerufstätig als Journalistin und PR-Referentin mit Schwerpunkt Gesundheitswesen.\nSeit Mai 2008 Stadträtin, Sprecherin im Gesundheitsausschuss, Mitglied in den Ausschüssen Arbeit und Wirtschaft, Bildung und Sport.\nIm Aufsichtsrat von SWM Services, Verwaltungsbeirätin für Europa und Städtische Friedhöfe. Mitglied im Gesundheitsbeirat, Sportbeirat und im  Bayerischen Städtetag.\n\nPolitische Schwerpunkte:\n- Gesundheit\n- Wirtschaft und Europa\n- Heimatvertriebene und Aussiedler\n- Medien  ', 'http://www.manuela-olhausen.de/', 'Dr. Olhausen, Manuela', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_manuela_olhausen-860-47174.html'),
(1418513, '2008-03-02', 'Geboren am 30. April 1972 in München, verheiratet, zwei Töchter. \nMetzgermeister, Betriebswirt des Handwerks. Nach Gymnasium, Lehre, Meisterprüfung, 1999 Gründung eines mittelständischen Metzgereibetriebes.\nObermeister der Metzgerinnung  München, Landesinnungsmeister des bayerischen Fleischerhandwerks, Mitglied des Vorstandes der Handwerkskammer für München und Oberbayern.\nIn den Stadtrat gewählt am 2.3.2008\nMitglied im Ausschuss für Arbeit und Wirtschaft, im Kommunalausschuss und im Finanzausschuss.\n\nEr tritt ein für:\n- gesunde und verlässliche Wirtschaftspolitik,\n- verantwortungsvolles Haushalten,\n- Förderung des Handwerks,\n- Nebeneinander und Miteinander der verschiedenen Lebensentwürfe.', '', 'Schlagbauer, Georg', NULL, NULL, 'http://www.abgeordnetenwatch.de/georg_schlagbauer-860-47170.html'),
(1418516, '2008-03-02', 'Geboren am 25.7.1945 in Hörmannsdorf Ndb., verheiratet seit 30.7.1966, zwei Söhne, drei Enkel.\nAusbildung/Beruf: 1955-59 Volksschule, Humanistisches Gymnasium. 1959-61 kauf. Lehre. BWL-Studium TU-München mit Abschluss als Betriebswirt (VWA). 1983 Schritt zur Selbständigkeit. Ortsvorsitzender des CSU-Ortsverbands Sendling-Westpark, stv. Kreisvorsitzender CSU-KV6 München-Süd. Mitglied im Bezirksausschuss 7, Sendling-Westpark.\nAusschüsse: stv. Sprecher im Bauausschuss, Kommunalausschuss.\nVerwaltungsbeirat: Baureferat, Abt. Hochbau. Kommunalreferat, Kleingärten. Trachtenbeirat. Vereine und Verbände: Regionaler Planungsverband München. Erholungsflächenverein.\nStiftungen: Jubiläum-Stiftung Alte Heimat. \nAufsichtsrat: München Ticket GmbH. \n\nMeine politischen Ziele:\nwww.seidl-muenchen.de.', 'http://www.seidl-muenchen.de/', 'Seidl, Otto', NULL, NULL, 'http://www.abgeordnetenwatch.de/otto_seidl-860-47182.html'),
(1418519, NULL, '&nbsp;', 'http://www.tobi-weiss.de/', 'Weiß, Tobias', 'tobiweiss', NULL, 'http://www.abgeordnetenwatch.de/tobias_weiss-860-47179.html'),
(1418521, '2008-03-02', 'Geboren 1980 in München, ein Sohn, Dipl.-Sozialpädagogin.\n\nMitglied im Sozialausschuss, im Kinder- und Jugendhilfeausschuss und im Bildungs- und Sportausschuss.\nSeit 2002 im Bezirksausschuss Laim.\nStadträtin seit 2008.\nSportpolitische Sprecherin.\n\nIch setze mich ein für\n- Teilhabe und Chancengleichheit aller Menschen im öffentlichen Leben.\n- Partizipation und Gleichstellung in allen Lebenslagen.\n- eine Stärkung der Vielfalt der Sportmöglichkeiten.\n- gute Bildung und Kindertagesbetreuung.\n- Integration und interkulturellen Dialog.\n\nMein Ziel ist ein bürgernahes und sozial gerechtes München.', 'http://www.verena-dietl.de/', 'Dietl, Verena', NULL, NULL, 'http://www.abgeordnetenwatch.de/verena_dietl-860-47204.html'),
(1418524, '2008-03-02', '&nbsp;', '', 'Hacker, Christiane', NULL, NULL, 'http://www.abgeordnetenwatch.de/christiane_hacker-860-47208.html'),
(1418527, '2008-03-02', 'Geboren am 13. September 1963 in Amberg, gewerblich-technische Ausbildung, Geschäftsführer der IG Metall München, Mitglied des Vorstandes der IG Metall und ehrenamtlicher Arbeitsrichter.\n\nStadtrat seit 2008.\nAufsichtsratsmitglied bei der BMW AG, MAN Truck & Bus AG und Krauss Maffei GmbH.\n\nMitglied in den Ausschüssen Arbeit und Wirtschaft, Finanzen und Kultur. Aufsichtsrat im Städtischen Klinikum und im Münchner Volkstheater. \n\nSchwerpunkte:\n- Erhalt der kommunalen Daseinsvorsorge\n- Wirtschafts- und Beschäftigungspolitik im Sinne der Arbeitnehmer\n- Balance zwischen Arbeit und Wirtschaft', '', 'Lischka, Horst', NULL, NULL, 'http://www.abgeordnetenwatch.de/horst_lischka-860-47212.html'),
(1418530, '2008-03-02', '&nbsp;', 'http://www.andreas-lotte.de/', 'Lotte, Andreas', 'Andreas_Lotte', 'andreas.lotte', 'http://www.abgeordnetenwatch.de/andreas_lotte-860-47213.html'),
(1418533, '2008-03-02', 'Geboren 1953 in Mecklenburg, verheiratet, zwei Kinder.\nJuristin, selbständige Verlegerin.\n\nStadträtin seit 2008.\nUmweltpolitische Sprecherin, stv. Sprecherin im Planungsausschuss.\nMitglied im Ausschuss für Stadtplanung und Bauordnung, im Kommunalauschuss und Umweltausschuss.\nAufsichtsrätin der Wohnungsbaugesellschaften GWG und GEWOFAG, Verwaltungsbeirätin für den Abfallwirtschaftsbetrieb München.\n\nKommunalpolitische Ziele:\n- soziale und ökologische Stadtentwicklung\n- lebendige Nachbarschaften mit vielfältiger Infrastruktur\n- Schaffung von bezahlbarem Wohnraum\n- zukunftsfähige Verkehrsplanung mit leistungsstarkem öffentlichen Nahverkehr', '', 'Rieke, Heide', NULL, NULL, 'http://www.abgeordnetenwatch.de/heide_rieke-860-47218.html'),
(1418536, '2008-03-02', '&nbsp;', '', 'Dr. Sieber, Inci', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_inci_sieber-860-47224.html'),
(1418539, '2008-03-02', 'Geboren am 20.4.1964 in München, verheiratet, zwei Kinder, Ärztin.\nFraktionssprecherin im BA Pasing - Obermenzing, im Stadtrat seit 2008.\n\nMitglied im Bau-, Kultur- und Sozialausschuss, stv. sozialpolitische und seniorenpolitische Sprecherin.\n\nMeine Ziele:\n- Ausbau der Kinderbetreuung und der Ganztagsschulen zur besseren Vereinbarkeit von Familie und Beruf\n- Seniorengerechte Angebote und Wohnungen für ein selbstbestimmtes Leben in Würde\n- Erhalt der Städtischen Kliniken in kommunaler Hand mit Spitzenmedizin für alle\n- Vielfalt in der Kulturlandschaft \n- Ausbau des Radwegenetzes, sichere Radwegeführung, mehr moderne Fahrradabstellanlagen\n- Ausbau des ÖPNV', '', 'Dr. Söllner-Schaar, Constanze', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_constanze_soellner_schaar-860-47225.html'),
(1418542, '2008-03-02', 'Geboren 1960 in Koblenz, seit 1985 in München, drei Kinder, Bankkauffrau.\n\nSeit 2008 im Stadtrat.\nBildungspolitische Sprecherin.\n\nMitglied im Bildungs-, Sport-, Kinder- und Jugendhilfe- und Bauausschuss \n\nSchwerpunkte:\n- Bildungsgerechtigkeit\n- Erhalt des kommunalen Schulwesens\n- Förderung des Breitensports und Aufwertung der ehrenamtlichen Arbeit in Vereinen\n- Optimierung des Sportstättenmanagements; Erhalt und Sanierung bestehender Sportanlagen.', '', 'Volk, Birgit', NULL, NULL, 'http://www.abgeordnetenwatch.de/birgit_volk-860-47229.html'),
(1418545, '2008-03-02', 'Geboren am 23.9.1963, aufgewachsen in Wemding/Bay., seit 1983 in München, Vater von drei Kindern.\nGeographiestudium an der TU München, seit 1991 tätig als Stadt- und Verkehrsplaner, seit 1998 selbstständig, zusätzlich Radreiseautor.\n\n1994 ? 96 und seit 1999 Mitglied im Bezirksausschuss Ludwigsvorstadt-Isarvorstadt, seit 2008 im Stadtrat, in den Ausschüssen für Stadtplanung und Bauordnung, für Arbeit und Wirtschaft sowie im Bauausschuss und im Aufsichtsrat der MVG.\n\nKommunalpolitische Ziele\n- Urbane, grüne und familienfreundliche Stadtviertel mit lebendiger Mischung, kurzen Wegen und attraktiven öffentlichen Räumen\n- Stadt- und klimaverträgliche Mobilität mit besonderem Schwerpunkt beim Fuß- und Radverkehr.', 'http://www.paul-bickelbacher.de/', 'Bickelbacher, Paul', NULL, NULL, 'http://www.abgeordnetenwatch.de/paul_bickelbacher-860-47150.html'),
(1418548, '2008-03-02', 'Geboren am 10.9.1964 in Malatya, Türkei, eine erwachsene Tochter, Dipl.-Sozialpädagogin bei der Arbeiterwohlfahrt.\n\nFraktionsvorsitzende.\n\nStadträtin seit 2008, Mitglied im Sozial-, Kommunal- und Kinder- und Jugendhilfeausschuss sowie in der Gleichstellungskommission.\n\nSchwerpunkte:\n- Sozialpolitik\n- Kinder- und Jugendpolitik\n- Migrationspolitik\n- Wohnen.', '', 'Demirel, Gülseren', NULL, NULL, 'http://www.abgeordnetenwatch.de/guelseren_demirel-860-47155.html'),
(1418551, '2008-03-02', 'Geb. am 22.11.1963 in Stuttgart, zwei Kinder, seit 1983 in München. Studium der Geographie, Stadt- und Verkehrsplanung an der TU München. Tätigkeit in verschiedenen Planungs- und Ingenieurbüros, im Planungsreferat und bei der MVG. Seit 2008 im Stadtrat.\nMitglied im Umwelt-, Planungs- und Kulturausschuss, im Hauptausschuss des Deutschen Städtetages und im Wirtschafts- und Verkehrsausschusses des Bayerischen Städtetages sowie im Aufsichtsrat der Messe München GmbH, der GEWOFAG und der Gasteig München GmbH.\n\nSchwerpunkte:\n- Nachhaltige Stadtentwicklung (sozial, ökologisch, familienfreundlich) \n- Ökologische Verkehrsplanung (Öffentlicher Verkehr, Fuß- und Radverkehr)\n- Neue Energiekonzepte (Erneuerbare Energien, Energieeffizienz)\n- Integrierende Stadtgesellschaft (multikulturell, solidarisch).', 'http://www.sabine-nallinger.de/', 'Nallinger, Sabine', NULL, 'sabine.nallinger', 'http://www.abgeordnetenwatch.de/sabine_nallinger-860-47157.html'),
(1418554, '2008-03-02', 'Geboren 1967 in Hermannstadt/Sibiu (Rumänien), Philosoph (M.A.) und Politologe (Promotion), Bildungsberater (Referat für Bildung und Sport), Philosophiedozent an der Münchner Volkshochschule.\n2001 - 2007 Vorsitzender der Münchner Grünen.\nFraktionsvorsitzender, Mitglied im Kultur-, Verwaltungs- und Personal- und Finanzausschuss sowie im Ältestenrat. Aufsichtsrat der Münchner Volkshochschule und des Münchner Volkstheaters.\n\nPolitische Ziele:\n- Chancengerechtigkeit und Innovation in der Bildung.\n- Integration von Migrantinnen und Migranten.\n- Vielfalt in der Kultur, Förderung der freien Szene.\n- Stärkung der Bürgerbeteiligung. \n- bürgerfreundliche Verwaltung.\n', 'http://www.florian-roth.com/', 'Dr. Roth, Florian', 'roth_florian', 'drflorianroth', 'http://www.abgeordnetenwatch.de/dr_florian_roth-860-47154.html'),
(1418557, NULL, '&nbsp;', 'http://www.florianvogel.de/', 'Dr. Vogel, Florian', NULL, NULL, 'http://www.abgeordnetenwatch.de/dr_florian_vogel-860-47159.html');
INSERT INTO `stadtraetInnen` (`id`, `gewaehlt_am`, `bio`, `web`, `name`, `twitter`, `facebook`, `abgeordnetenwatch`) VALUES
(1418560, '2008-03-02', 'Geboren am 6.10.1953 in Mainz, verpartnert seit 2006. Studium der Wirtschaftsu. Politikwissenschaften. Seit 1982 in verschiedenen Unternehmen tätig, meist in der Geschäftsleitung, seit 2003 selbständiger Unternehmensberater. Seit 1972 Mitglied der FDP; 1979-1984 Stadtrat in Mainz. 1988-1994 Vorsitzender FDP München, 1991-1997 stv. Landesvorsitzender in Bayern und 2008-2014 Fraktionsvorsitzender der FDP im Münchner Stadtrat. Seit 2014 Fraktionsvorsitzender der Fraktion Freiheitsrechte, Transparenz, Bürgerbeteiligung.\nMitglied: Ältestenrat, Stadtplanung und Bauordnungs-, Finanz- sowie Rechnungsprüfungsausschuss. \n\nSchwerpunkte:\n- Investitionsstau bei Schulen und Verkehr auflösen,\n- Wohnungsbau verstärken\n- Freiheitliche Lösungen statt Gängelei und Bevormundung\n- Stadtwerke nicht als Global Player', 'http://www.michaelmattar.de/', 'Dr. Mattar, Michael', 'DrMichaelMattar', 'DrMichaelMattar', 'http://www.abgeordnetenwatch.de/dr_michael_mattar-860-47192.html'),
(1418563, '2008-03-02', '&nbsp;', '', 'Prof. Dr. Hoffmann, Jörg', NULL, NULL, 'http://www.abgeordnetenwatch.de/prof_dr_joerg_hoffmann-860-47191.html'),
(1418569, '2008-03-02', '&nbsp;', '', 'Henn, Dagmar', NULL, NULL, 'http://www.abgeordnetenwatch.de/dagmar_henn-860-47187.html'),
(1418572, '2008-03-02', 'Geboren 1959 in Stuttgart, seit 1979 in München lebend; ledig.\nStudium der Rechts- und Politikwissenschaft sowie der Erwachsenenpädagogik.\nAktuell als Professor für European Studies an der Hochschule München tätig.\nSeit Mai 2008 im Stadtrat.\n\nBesondere Anliegen und Ziele:\n Bessere Verkehrsinfrastruktur,\n bezahlbarer Wohnraum,\n flächendeckende Kinderbetreuungsangebote,\n Unterstützung ehrenamtlicher Tätigkeit,\n Bürgernähe in Politik und Verwaltung.\n\nAusschüsse:\nBauausschuss, Finanzausschuss, Kulturausschuss sowie Ausschuss für Stadtplanung und Bauordnung.', '', 'Prof. Dr. Piazolo, Michael', NULL, NULL, NULL),
(1418575, '2008-03-02', 'Geb. 12.03.1982 in Pasing.\nSelbständiger Programmierer und Examenskandidat (Jura).\nMitglied im Kreisverwaltungs-, Gesundheits-, Personal- und Sport-/Schulausschuss.\n\nIch bin ein überzeugter Verfechter der kommunalen Selbstverwaltung und ein Gegner jeden Zentralismus - sei es auf europäischer, bundesdeutscher oder bayerischer Ebene.\nGerade das hat mich bewogen, für den Stadtrat zu kandidieren.\nZu meinen Anliegen gehört es, dass München die liebenswerte Stadt bleibt, die jedes Jahr Millionen Touristen und tausende Neubürger anzieht. Trotz aller Weltoffenheit und Toleranz dürfen wir dabei aber unsere eigene Identität nicht noch weiter verlieren.\nMünchen ist eine Weltstadt mit Herz - und dieses Herz muss weiß-blau bleiben!', '', 'Hummel, Thomas', NULL, NULL, NULL),
(1418578, '2008-03-02', 'Geboren 1962 in München, röm.- kath., Abitur am Luitpold-Gymnasium, nach dem Wehrdienst Studium in den Fächern Geschichte, Musikwissenschaft, Sanskrit und Volkskunde an der LMU. 1989 ? 94 Parlamentarischer Referent am Europäischen Parlament. 2001 Wiedereintritt in die Bundeswehr, dort u.a. Aufgaben im Bereich der politischen Bildung.\nSeit 2009 stellvertretender NPDParteivorsitzender.\nStadtrat in München seit 2008.\nAutor mehrerer Bücher.\n\nKommunalpolitische Ziele:\n- Kein Islamzentrum in München!\n- Wohnungen bevorzugt für Einheimische statt für "Migrationshintergründler"!\n- Schluß mit der städtischen Förderung linksextremer Szenetreffs!\n- Münchner Schulen sanieren statt Schwulenförderung!', '', 'Richter, Karl', NULL, NULL, 'http://www.abgeordnetenwatch.de/karl_richter-860-47162.html'),
(1418592, '2008-03-02', '&nbsp;', '', 'Salzmann, Regina', NULL, NULL, 'http://www.abgeordnetenwatch.de/regina_salzmann-860-47220.html'),
