(1624902, '2008-03-02', 'Geboren 1968 in München, Gewerkschaftssekretärin für Frauen und Gleichstellung bei ver.di Bayern. Mitglied in Vereinen, u. a. ADFC, AWO, LBV, Freunde der Vorstadt Au, Mieter helfen Mietern, Bücher & mehr, Tierschutzverein München, VdK, Radio Lora \n\nStadträtin seit 2008, Korreferentin des Personal- und Organisationsreferates, Sprecherin für Tierschutz. Mitglied in den Ausschüssen für Stadtplanung und Bauordnung, Verwaltung und Personal und Bau und Stadtentwässerung, Aufsichtsrätin der Münchner Tierpark Hellabrunn AG\n\nMeine Schwerpunkte:\n- Politik für Arbeitnehmerinnen und Arbeitnehmer\n- Gleichstellung von Frauen und Männern \n- Bezahlbarer Wohnraum und Mieterschutz \n- Tierschutz\n', 'http://www.bettina-messinger.de/', 'Messinger, Bettina', NULL, 'bettina.messinger', 'http://www.abgeordnetenwatch.de/bettina_messinger-860-47197.html'),
