(1948678, '2008-03-28', 'Geboren am 19. September 1976 in München. Verheiratet, eine Tochter. Studium der Forstwirtschaft an der FH Weihenstephan.\nGeschäftsführer eines Unternehmens im Bereich Erneuerbare Energien.\nGewässerökologe bei der Fachberatung für Fischerei Bezirk Schwaben.\nBezirksrat Oberbayern.\nIm Stadtrat seit Januar 2010.\nMitglied im Bau- und Stadtentwässerungsausschuss,  im Kommunalausschuss, im Sozialausschuss und im Umweltausschuss.\n\nSchwerpunkte\n- Erneuerbare Energien, als Antwort auf den Klimawandel und die Energieverknappung \n- Förderung von Ökologie und Naherholung\n- Öffentlicher Personennahverkehr\n- Nachhaltiges Wirtschaften', '', 'Ruff, Tobias', NULL, 'Tobias-Ruff-ÖDP-Stadtrat', 'http://www.abgeordnetenwatch.de/tobias_ruff-860-47195.html'),
