(2118323, NULL, 'Geboren am 17.8.1979 in München, Diplom-Betriebswirt (FH), verheiratet, zwei Töchter.\nStadtrat der BAYERNPARTEI seit September 2010.\nMitglied im Kreisverwaltungsausschuss und im Ausschuss für Arbeit und Wirtschaft.  Verwaltungsbeirat Strassenverkehr.\n\nKommunalpolitische Schwerpunkte:\n- Erhalt der bairischen Sprache und Traditionen\n- kein Wachstum um jeden Preis\n- Förderung des hiesigen Mittelstandes\n- sinnvolles Miteinander aller Verkehrsteilnehmer statt Radl-Dogmatik\n- Schaffung von notwendigen Parkmöglichkeiten in Tiefgaragen, Nutzung der oberirdischen Flächen zur Naherholung', '', 'Progl, Richard', NULL, NULL, 'http://www.abgeordnetenwatch.de/richard_progl-860-47152.html'),
