(2943496, NULL, 'Geboren am 5.10.1954 in München, verheiratet, ein Sohn, eine Tochter, Solarenergieberater, Baubiologe und Umweltberater.\n\nMitglied in folgenden Ausschüssen:\nBauausschuss zzgl. Korreferent des Baureferats, Kommunalausschuss und Planungsausschuss.\nMitglied in der Freihamkommission und im Riembeirat. \n\nSchwerpunkte und Ziele:\nDie aktuelle dynamische Stadtentwicklung sozial und umweltfreundlich gestalten durch energieeffiziente und nachhaltige Gebäude, verstärkte dezentrale Nutzung der Solarenergie, Schaffung dauerhaft bezahlbaren Wohnraums, bauökologische Sanierung städtischer Immobilien, attraktive öffentliche Räume, eine umweltfreundliche Mobilitätskultur und gerechte Bildungschancen.', '', 'Danner, Herbert', NULL, NULL, 'http://www.abgeordnetenwatch.de/herbert_danner-860-67761.html'),
