(3137651, NULL, 'Geboren am 24.7.1975 in München, verheiratet, drei Stiefkinder.\n\nAbitur am Wittelsbacher-Gymnasium, Studium der Rechtswissenschaften und Promotion zum Dr. jur. an der Ludwig-Maximilians-Universität.\nRichter am Amtsgericht München\n\nStadtrat seit 2013\n\nFunktionen:\nKorreferent des Kreisverwaltungsreferates, Sprecher der CSU-Fraktion im Kreisverwaltungsausschuss und im Verwaltungs- und Personalausschuss, Mitglied im Finanzausschuss und im Aufsichtsrat der Städtisches Klinikum München GmbH. \n\nWeiteres: 1. stv. BA-Vorsitzender in Moosach (seit 1996)', '', 'Dr. Dietrich, Alexander', NULL, NULL, NULL),
