(3312430, '2014-03-16', 'Geboren am 1.9.1961 in Adana/Türkei und lebt seit 1982 in München. Politologe, Sozialpädagoge. Verheiratet, zwei Kinder. Stadtrat seit Mai 2014.\nMigrationspolitischer Sprecher der SPD-Fraktion.\nMitglied im Sozial-, Bildungs-, Sport- und Kreisverwaltungsausschuss.\nMitglied der Stadtratskommission für Integration.\nBeratendes Mitglied des Sportbeirates und des Ausländerbeirates.\nMitglied der Taxikommission.\nMitglied des Beirates für das Eine-WeltHaus.\nJurymitglied für die Preisverleihung des Phönix-Preises.\n\nSchwerpunkte:\n- Integrations- und Flüchtlingspolitik,\n- Sportförderung,\n- Kommunales Bildungsmanagement\n- Förderung des interkulturellen und interreligiösen Dialogs.', 'http://cumalinaz.de/', 'Naz, Cumali', NULL, 'cumali.naz.5', NULL),
(3312434, '2014-03-16', 'Geboren 1971 in München, verheiratet, 2 Kinder.\nAbitur am Sophie-Scholl-Gymnasium, München; Studium der Rechtswissenschaften und Referendariat in München.\nBerufstätig als Juristin bei einer Betriebskrankenkasse.\n\nSeit 2014 im Stadtrat. Mitglied im Gesundheits-, Bildungs-, Sport- und Kulturausschuss.\n\nMeine politischen Schwerpunkte:\n- Ausbau der Kindertagesbetreuung\n- Förderung der kulturellen Vielfalt\n- Schaffung und Erhalt bezahlbaren Wohnraums\n- Förderung des Breitensports\n- Vielfältige Gesundheitsangebote für alle \n', '', 'Abele, Kathrin', NULL, 'kathrin.abele.5', NULL),
(3312436, '2014-03-16', 'Geboren am 30.7.1980 in Hannover, seit 2000 in München. Dipl.-Politikwissenschaftler und wissenschaftlicher Referent. Im Vorstand der Münchner SPD und Vorsitzender der SPD Sendling-Westpark. Vorsitzender der Jusos München (2007-09). Seit 2008 Mitglied im BA Sendling - Westpark.\nMitglied im Ausschuss für Arbeit und Wirtschaft, Bau-, Kommunal- und Umweltausschuss, im Bayerischen Städtetag, im Aufsichtsrat MünchenTicket GmbH und Münchner Gewerbehof und Technologiezentrumsgesellschaft sowie der Stadtratskommissionen Energie und Europa. Stv. kommunal- und umweltpolitischer Sprecher. \n\nDafür setze ich mich ein:\n- Bürgernahe Kommunalpolitik.\n- Kommunale Daseinsvorsorge stärken.\n- bezahlbares Wohnen und Leben.\n- ÖPNV verbessern und ausbauen.\n- Lebendige Parks und Naherholungsgebiete in der Stadt.', '', 'Röver, Jens', NULL, 'jensroever', NULL),
(3312483, '2014-03-16', 'Geboren am 28.2.1982 in Lindau.\nMagisterstudium der Germanistik, Linguistik und Pädagogik in München.\nAusbildung als systemischer Coach.\nVon 1995 bis 2011 Mitglied der Paralympischen Nationalmannschaft im Skilanglauf und Biathlon.\n2012 in die SPD eingetreten, im Landtagswahlkampf 2013 im Team von Christian Ude Expertin für Sport und Inklusion. Seit Januar 2014 Beauftragte der Bundesregierung für die Belange behinderter Menschen.\nIm Stadtrat seit Mai 2014; Mitglied im Finanzausschuss, IT-Ausschuss, im Gesundheitsausschuss sowie im Verwaltungs- und Personalausschuss.\n\nMeine Ziele:\n- Inklusion und Chancengleichheit.\n- Bildung und Arbeit.\n- Gesundheitsversorgung und qualifizierte Pflege.\n- Mobilität und nachhaltige Stadtplanung.', 'http://verena-bentele.com/', 'Bentele, Verena', NULL, 'benteleverena', NULL),
(3312514, '2014-03-16', 'Geboren 1979 im Oberallgäu, Studium der Politikwissenschaft, seit 2012 DGB Regionsgeschäftsführerin München.\n\nIm Stadtrat seit 2014.\n\nMitglied im Ausschuss für Arbeit und Wirtschaft, im Sozialausschuss und im Gesundheitsausschuss.\n\nBesondere Anliegen:\n- Wahrnehmung von Arbeitnehmerinteressen\n- eine zukunftsorientierte berufliche Ausbildung\n- Zugang für alle zu einer sehr guten Gesundheitsversorgung\n- ein soziales München, in dem sich alle zu Hause fühlen', '', 'Burger, Simone', NULL, 'simone.burger.790', NULL),
(3312531, '2014-03-16', 'Geboren 1966 in Nevsehir, Türkei.\nKam als Kind politischer Flüchtlinge 1973 nach München.\nAusbildung als Energieanlagenelektroniker. Musiker, Sänger.\nEngagiert in außerparlamentarischen Bewegungen: Kurdistan-Solidarität, Friedensbewegung, Anti-Rassismus Bewegung. Mitglied der DKP.\n\nAls Stadtrat Mitglied im Sozial-, Kinder- und Jugendhilfeausschuss sowie im  Kreisverwaltungsausschuss, im Bildungs und im Sportausschuss.\n\nSchwerpunkte im Stadtrat\n- Sozialpolitik\n- Migrationspolitik\n- Kinder-und Jugendpolitik', '', 'Oraner, Cetin', NULL, 'cetin.oraner.98', NULL),
(3312549, '2014-03-16', 'Geboren am 11.6.1979 in München, eine Tochter, Dipl.-Informatikerin, Master of Business Administration, CSU-Ortsvorsitzende im Perlacher Forst, Kreisgeschäftsführerin im Kreisverband IV.\n\nSeit 2014 Mitglied des Münchner Stadtrats.\n\nStv. Sprecherin im Ausschuss für Bildung und im IT-Ausschuss.\nMitglied in der IT-Kommision. Weiterhin Mitglied im Sport-, Verwaltungs- und Personal- sowie im Kreisverwaltungsausschuss.\n\nMitglied des Aufsichtsrates der München Stift GmbH sowie Mitglied des Beirates der Portal München Betriebs-GmbH & Co KG. \n\nZuständige Verwaltungsbeiratsgebiete: Kindertagesbetreuung und Kommunales Bildungsmanagement.', '', 'Pfeiler, Sabine', NULL, 'sabine.pfeiler', NULL),
(3312572, '2014-03-16', 'Geboren am 2. April 1981 in München. Verheiratet.\nNach Abitur am Max-Planck-Gymnasium in München-Pasing Studium der Rechtswissenschaften und anschließendes Referendariat in München, Jakarta und Sydney. Im Anschluss Rechtsanwältin und Staatsanwältin;\nderzeit Richterin am Landgericht.\n\nSeit 2014 Mitglied des Münchner Stadtrats und des Bezirksausschusses 9 (Neuhausen-Nymphenburg).\n\nStellvertretende Vorsitzende des Rechnungsprüfungsausschusses. \nStellvertretende Sprecherin im Sportausschuss und im Verwaltungs- und Personalausschuss. Mitglied im Kultur-, Kommunal-, IT- und Bildungsausschuss.\n\nMeine Ziele finden Sie auf meiner Homepage www.kristina-frank.de.', 'http://kristina-frank.de/', 'Frank, Kristina', NULL, 'kristinafrank2014', NULL),
(3312585, '2014-03-16', 'Geboren am 13.4.1970 in München, verheiratet, röm.-kath, Maschinenbauer. 1989 Abitur am Max-Planck- Gymnasium in Pasing, Wehrdienst, Ausbildung.\n\nSeit 2014 im Stadtrat.\n\nAusschüsse:\nAusschuss für Stadtplanung und Bauordnung, Finanzausschuss Mitglied der Bauleitplankommission \n\nSchwerpunkte:\n- gesunde Wirtschaft durch Förderung des Mittelstandes\n- Sicherung der Lebensqualität\n- Unterstützung des Ehrenamtes \n\nMitglied im Bezirksausschuss Aubing - Lochhausen - Langwied', 'http://www.johann-sauerer.de/', 'Sauerer, Johann', NULL, 'johannsauerer', NULL),
(3312587, '2014-03-16', 'Am 5.5.1962 in Oberfranken geboren, seit 1982 in München lebend, verheiratet, zwei Töchter, evangelisch. Meisterbrief im Schneiderhandwerk und Diplom für Schnitt & Gestaltung. Seit 1987 selbstständig im Bereich Messen, Veranstaltungen und Modenschauen.\n\nSeit 2014 im Stadtrat.\nMitglied im Kultur-, Sozial-, Kinder- und Jugendhilfe-, Sportausschuss, Kommission zur Gleichstellung von Frauen. Mitglied im BA 16 Ramersdorf Perlach, Bezirksvorsitzende der FRAUEN UNION.\n\nBesondere Anliegen\n- Seniorinnen, Alleinerziehende und Familien.\n- Handwerk, kleine Gewerbetreibende und Mittelstand.\n- Tracht und Brauchtum.\n- Kunst und Kultur.\n\nwww.ulrike-grimm.eu', 'http://www.ulrike-grimm.eu/', 'Grimm, Ulrike', NULL, NULL, NULL),
(3312595, '2014-03-16', 'Geboren am 2.8.1983 in München, rk, verheiratet, mittelständischer Unternehmer, Diplomingenieur (FH) der Druck und Medientechnik, Ortsvorsitzender der CSU Trudering-Riem, Stv. Kreisvorsitzender der CSU München-Ost. Seit 2008 Mitglied im BA 15 Trudering-Riem Seit 2014 Mitglied des Stadtrates, Verwaltungsbeirat für Einwohnerwesen. Mitglied im Umwelt-, Kreisverwaltungs- und Bauausschuss, stv. Sprecher im Umweltausschuss, Mitglied der Energiekommission, Aufsichtsrat der Münchner Gesellschaft für Stadterneuerung mbH (MGS)\n\nZiele:\n- Förderung des Mittelstandes\n- Wahrung des Gartenstadt-Charakters\n- Lösung bestehender Verkehrsprobleme\n- Förderung von Vereinen und ehrenamtlichem Engagement\n- Förderung des Breitensports\n- Förderung von Musik und Kultur', 'http://www.sebastian-schall.com/', 'Schall, Sebastian', NULL, 'Schalli5', NULL),
(3312599, '2014-03-16', '&nbsp;', '', 'Schmid, Thomas', NULL, 'pages/Thomas-Schmid-CSU-Stadtrat/636652626381669', NULL),
(3312613, '2014-03-16', 'Geboren 1978 in Finsterwalde (Brandenburg), eine Tochter. Diplom-Verwaltungswirtin (FH), derzeit tätig als Fachreferentin für Seniorenpflege. \n\nMitglied der Ausschüsse Soziales, Kinder- und Jugendhilfe sowie Verwaltung, Personal und IT.\n\nMeine Ziele:\n- Die Vereinbarkeit von Familie und Beruf, v.a. auch für Alleinerziehende, weiter verbessern.\n- Älteren Menschen ein würdevolles Leben jenseits von Armut und sozialer Isolation ermöglichen.\n- Langzeitarbeitslosen ohne Chancen auf dem ersten Arbeitsmarkt neue Perspektiven eröffnen: Einstieg in einen öffentlichen Beschäftigungssektor.\n- Verwaltungsreform, Kommunales Wahlrecht ab 16 für alle, eGovernment, Freude an Politik bewahren.\n', 'http://anne-huebner.de/', 'Hübner, Anne', NULL, 'anne.huebner', NULL),
(3312618, '2014-03-16', 'Geboren 1977 in Nürnberg, verheiratet, zwei Kinder. Diplombetriebswirtin (FH), Bankkauffrau und Wald- und Wildnispädagogin. \n\nIm Stadtrat seit Mai 2014.\n\nSchwerpunkte:\n- Wirtschaftspolitik.\n- Stadtfinanzen.\n- Vereinbarkeit von Familie und Beruf - für Frauen und Männer.\n- gelebter Umweltschutz, von Kindern wie Erwachsenen.\n\nMitglied im Finanzausschuss, im Rechnungsprüfungsausschuss sowie im Ausschuss für Arbeit und Wirtschaft. \nAufsichtsrätin der Münchener Tierpark Hellabrunn AG und der Pasinger Fabrik GmbH. \nMitglied der Freiham- sowie der Gleichstellungskommission.', 'http://katrin-habenschaden.de/', 'Habenschaden, Katrin', 'KHabenschaden', 'katrin.habenschaden', NULL),
(3312624, '2014-03-16', 'Geboren am 2.6.1953, in Waren/Müritz, verheiratet, zwei Söhne; Studium der Soziologie an der LMU München, freier Journalist; in den Stadtrat gewählt am 16.3.2014.\n\nMitglied im Kreisverwaltungs-, Sport-, Verwaltungs- und Personal- und IT-Ausschuss sowie in der IT-Kommission, Stellv. Mitglied im Ältestenrat. Aufsichtsrat der Olympiapark GmbH, Sportbeirat, Verwaltungsbeirat der Stadtentwässerung, Fachbeirat BS Medienberufe, Taxikommission \n\nSchwerpunkte:\nTransparenz heißt für mich: Freie Information für den Bürger, frühzeitige Bürgerbeteiligung an Entscheidungsprozessen und Redlichkeit der handelnden Personen.', '', 'Ranft, Thomas', 'ranft53', NULL, NULL),
(3312626, '2014-03-16', 'Geb. 1976 in Kassel, aufgewachsen am Schliersee und in Bayreuth. Studium der Architektur (TU München), Master Denkmalpflege (TU Berlin), als Architektin angestellt. Seit Mai 2014 im  Stadtrat, Mitglied im Planungs-, Kommunal- und im Gesundheitsausschuss, im Aufsichtsrat der Olympiapark GmbH und im Riembeirat.\nVorsitzende des Bezirksausschuss Neuhausen - Nymphenburg\n\nMeine Ziele:\n- mehr Bürgerbeteiligung und Transparenz bei allen Entscheidungen.\n- ökologisch und soziale Nachhaltigkeit, Kreativität und Qualität beim Planen und Bauen.\n- mehr Grün an Fassaden, Dächern und im Straßenraum.\n- aktiv gegen rechten Populismus und Ausgrenzung.\n- mehr Platz für FußgängerInnen und konsequenter Ausbau des Radverkehrs und des ÖPNV.\n\nwww.anna-hanusch.de, Twitter: @anuka76', '', 'Hanusch, Anna', 'anuka76', 'ahanusch', NULL),
(3312636, '2014-03-16', 'Geboren am 15.9.1956, verheiratet, zwei Töchter, Rechtsanwältin, Mediatorin und Fachanwältin für Familienrecht. In München seit 1986, zunächst in der Au, seit 1994 in Allach.\nIm Stadtrat seit 2014, Mitglied im Planungs-, Bildungs- und Sozialausschuss. Seit 2002 Mitglied im Bezirksausschuss Allach-Untermenzing, seit 2008 BA-Vorsitzende.\n\nMeine Schwerpunkte sind:\n- Städtebauliche Planung mit Weitsicht unter Berücksichtigung der gewachsenen Strukturen in den Stadtvierteln, der notwendigen sozialen Einrichtungen und der Verkehrsbelange \n- Stärkung der Vereinbarkeit von Familie und Beruf, u.a. durch Ausbau der Betreuungseinrichtungen\n- Förderung der Lebensqualität im Alter, z.B. in Mehrgenerationenhäusern \n- Erweiterung der städtischen Bildungsangebote in und außerhalb des schulischen Bereiches', '', 'Kainz, Heike', NULL, 'heike.kainz.csu', NULL),
(3312640, NULL, 'Geboren am 19. Mai 1958 in Rain am Lech (Kreis Donau-Ries), Umzug bereits 1960 nach München. Verheiratet mit Petra Reiter, drei erwachsene Kinder.\n\nIn Sendling aufgewachsen und zur Schule gegangen. 1981 Abschluss als Diplomverwaltungswirt an der Fachhochschule für Öffentliche Verwaltung und Rechtspflege in Bayern. Von 1981 bis 2009 in der Stadtkämmerei tätig, u.a. als Büroleiter und Pressesprecher, Amtsleiter des Kassen- und Steueramts sowie als Stellvertretender Stadtkämmerer der LH München.\nVon 2009 bis 2014 berufsmäßiger Stadtrat als Referent für Arbeit und Wirtschaft.\n\nSeit 1. Mai 2014 Oberbürgermeister der Landeshauptstadt München. Leitung der Ausschüsse für Stadtplanung und Bauordnung, Arbeit und Wirtschaft, Verwaltung und Personal, des Finanzausschusses sowie der Stadtgestaltungskommission.\n\nAufsichtsratsvorsitzender der Stadtwerke München (SWM), der Münchner Verkehrsgesellschaft (MVG), der städtischen Wohnungsbaugesellschaften GWG und Gewofag sowie der Städtisches Klinikum München GmbH (StKM). Vertritt die Stadt im Aufsichtsrat der Flughafen München GmbH (FMG) und der Messe München GmbH (MMG). Vorsitzender der Gremien des MVV und des Verwaltungsrats der Stadtsparkasse München.\n\nMitglied der Gewerkschaft ver.di, der Arbeiterwohlfahrt München (AWO), des Mietervereins München e.V., sowie ehrenamtliches Mitglied der Georg-von-Vollmar-Akademie e.V., Mitglied im Kuratorium des Deutschen Museums, im Ifo-Institut München und bei der Freiwilligen Feuerwehr.\n\nZielsetzung: "München muss eine Stadt für alle bleiben. Nur so werden wir dieses einmalige Münchner Lebensgefühl bewahren, nur so wird München auch in Zukunft eine weltoffene, tolerante, soziale und gleichzeitig wirtschaftlich erfolgreiche Stadt sein."', '', 'Reiter, Dieter', NULL, 'OB2014', NULL),
(3312650, '2014-03-16', 'Geboren 1990 in München, Abitur 2009, anschließend Zivildienst, seit 2010 Student der Physik, 2012 ? 2014 Sprecher Grüne Jugend München, seit 2012 aktiv bei München ist bunt!\nMitglied im Kreisverwaltungs-, Umwelt-, Verwaltungs- und Personalausschuss und IT-Ausschuss\n\nSchwerpunkte:\n- Bürger_innenrechte und Demokratie\n- Kampf gegen Rechtsradikalismus\n- Umstieg Erneuerbare Energien und Energieeffizienz\n- Stärkung von Bürger_innen-Beteiligung\n- Gleichstellung von Lesben, Schwulen, Bisexuellen & Transgender\n- Erhalt und Ausbau der kommunalen Flüchtlingspolitik', 'http://dominik-krause.de/', 'Krause, Dominik', 'dominik_krause', 'dominik.krause.311', NULL),
(3312655, '2014-03-16', 'Geboren am 29. März 1969 in München, Mathematiker (Dipl.- Math., Universität Göttingen), tätig als freiberuflicher Programmierer. \n\nGlobal denken: \n- Free Speech\n- Freie Marktwirtschaft\n- Keine Schuldenmacherei\n\nLokal handeln:\n- Kosten der Energiewende in München dämpfen\n- Investition vor Konsum- (?Sozial?-) Ausgaben\n- Freier Wohnungsbau statt Vermietergängelung\n\nAusschüsse:\nUmwelt, Soziales, Stadtplanung und Bauordnung, außerdem Vertreter Münchens im Bayerischen Städtetag.', 'http://www.fritz-schmude.de/', 'Schmude, Fritz', NULL, NULL, NULL),
(3312658, '2014-03-16', 'Geboren am 13.7.1946; Studium der Betriebswirtschaft, Studium der Zahnheilkunde an der LMU. 1983 bis zur Übernahme des Ministeramtes tätig in der eigenen Zahnarztpraxis in München. 1990 - 2002 Mitglied des Vorstandes der Bayerischen Landeszahnärztekammer, seit 1994 Vizepräsident; 1993/1994 Landesvorsitzender Freier Verband Deutscher Zahnärzte (Bayern); 2000 - 2008 Präsident des Verbandes Freier Berufe in Bayern; 2000 bis 2008 Vorstandsmitglied  in der Vereinigungder  Bayerischen Wirtschaft, seit 2003 Vizepräsident; seit 1997 Beisitzer im Präsidium des Bundesverbandes der Freien Berufe.\n\nMitglied im Umwelt-, Gesundheits-, Kulturausschuss, Verwaltungsbeirat Kammerspiele, darstellende Kunst, Deutsches Theater und Volkstheater.\n\nSchwerpunkte: \nIntensivere Zusammenarbeit zwischen der Stadt und dem Freistaat im kulturellen Bereich und bei der Sanierung des Münchner Stadtklinikums.', '', 'Dr. Heubisch, Wolfgang', NULL, NULL, NULL),
(3312667, '2014-03-16', 'Geboren 1970 in München, verheiratet, zwei Kinder.\n\nGeschäftsführerin eines Kultur- und- Bürgerhauses.\n\nSeit 2014 im Stadtrat\n\nMitglied im Kultur-, Bildungs-, Sportund Kreisverwaltungsausschuss\n\nMeine politischen Schwerpunkte sind:\n- den Kultur- und Kreativstandort zu fördern.\n- Bildung gerecht und zukunftsorientiert zu gestalten.\n- Förderung von Ökologie und Erholung.\n- Münchens Wachstum fair zu organisieren.\n- Förderung von Ehrenamt und der Vielfalt der Sportmöglichkeiten.\n- eine bürgerfreundliche Verwaltung.', '', 'Schönfeld-Knor, Julia', NULL, 'julia.schoenfeld.3', NULL),
(3312668, '2014-03-16', 'Geboren am 15. Juni 1964 in München, verheiratet, zwei Kinder.\nBankfachwirtin, Fundraising Managerin (FA). Umweltberaterin für europäische Umweltorganisationen im Bereich Chemikalien, Projektmanagement und Fundraising.\n\nSeit 2014 im Münchner Stadtrat Mitglied im Umwelt-, Finanz- und Kulturausschuss und im Bezirksausschuss 21 Pasing/Obermenzing \n\nSchwerpunkte:\n- lebenswerte Stadtviertel mit Nahversorgung, Grünflachen und attraktiven Kulturangeboten.\n- umweltverträgliche Mobilität, Ausbau des Radwegenetzes.\n- nachhaltige und zukunftsfähige Finanzpolitik.\n\nWeitere Informationen auf www.sonja-haider.de', 'http://www.sonja-haider.de/', 'Haider, Sonja', NULL, 'sonja.haider.7', NULL),
(3312675, '2014-03-16', 'Geboren 1965, Forchheim / Obfr., Mitarbeiter an der Münchner Volkshochschule, ehrenamtlicher Behindertenbeauftragter der Landeshauptstadt München.\n\nMitglied im Sozialausschuss, im Bildungsausschuss und im Sportausschuss. \n\nAufsichtsrat der Münchenstift GmbH\n\nPolitische Ziele:\n- Belange von alten und pflegebedürftigen Menschen nicht vergessen\n- Mehr Teilhabe von Menschen mit Behinderungen\n- In allen Bereichen der Stadtpolitik unkonventionelles Denken und Handeln fördern\n\n', 'http://www.oswald-utz.de/', 'Utz, Oswald', NULL, 'oswald.utz', NULL),
(3312677, '2014-03-16', 'Geboren am 26.07.1973, eine Tochter, Dipl. Betriebswirt (FH), Bundesbankamtsrat.\n\nMitglied im Ausschuss für Arbeit und Wirtschaft, im Sportausschuss und im Bildungsausschuss. Aufsichtsrat in der GWG und der Olympiapark München GmbH. Vorsitzender des Landesverbandes Bayern der Alternative für Deutschland. \n\nKommunalpolitische Schwerpunkte:\n- Ideologiefreie und lösungsorientierte Verkehrspolitik\n- Familiengerechter Wohnungsbau, der sich an der finanziellen Leistungsfähigkeit von Familien orientiert\n- Senkung der Steuer- und Abgabenlast der Bürger und Unternehmen\n- Bildungschancen für alle: Schaffung bestmöglicher Rahmenbedingungen in den Münchner Bildungsstätten', 'http://www.andre-waechter.de', 'Wächter, Andre', 'Andre_Waechter', 'afd.waechter', NULL),
(3312685, '2014-03-16', 'Geboren 1973 in Beirut, Libanon Rechtsanwalt/Strafverteidiger. \nIm Stadtrat seit 2014.\nMitglied im Kreisverwaltungsausschuss, im Kulturausschuss und im Verwaltungs- und Personalausschuss. \nAufsichtsrat der Münchner Volkshochschule, Beirat der Münchner Regenbogen-Stiftung, im Kuratorium der Otto-Falckenberg-Schule, Beirat der Portal München Betriebs GmbH, im Politischen Beirat für das NS-Dokumentationszentrum, Taxikommission, Vertretung in der Europäischen Städtekoalition gegen Rassismus (ECCAR),  Vertretung im Rettungszweckverband München.\n\nMeine Schwerpunkte und Ziele:\n- Für ein buntes München\n- Gleichstellungspolitik für Lesben, Schwule und Transgender\n- Für eine kulturelle Vielfalt\n- Für eine Stärkung des sozialen Zusammenhalts', 'http://christian-vorlaender.de/', 'Vorländer, Christian', NULL, 'christian.vorlander', NULL),
(3312693, '2014-03-16', '&nbsp;', '', 'Zeilhofer-Rath, Wolfgang', NULL, 'wolfgang.zeilnhoferrath', NULL);
