(3312695, '2014-03-16', 'Geboren am 20. September 1977 in München, verheiratet.\nOberarzt, Facharzt für Innere Medizin, Kardiologie und internistische Intensivmedizin, Master of Health Business Administration. Medizinstudium an der LMU München, ärztliche Tätigkeit am Klinikum Großhadern seit 2003.\nMitglied im geschäftsführenden Landesvorstand des Gesundheitspolitischen Arbeitskreises der CSU. \nIn den Stadtrat gewählt am 16. März 2014.\n\nGesundheitspolitischer Sprecher der CSU Stadtratsfraktion, Mitglied im Aufsichtsrat der Städtisches Klinikum München GmbH, stellvertr. Korreferent für Finanzen.\n\nMitglied im Gesundheitsausschuss, Finanzausschuss und Umweltausschuss.', 'http://www.hans-theiss.de/', 'Dr. Theiss, Hans', NULL, NULL, NULL),
