(3335227, NULL, 'Geboren am 5.12.1960 in München, Metallbauer, Dipl. Sozialpädagoge (FH). Vorstand und Initiator der Wählergruppe HUT.\n\nMitglied im Kinder- und Jugendhilfe-, Sozial-, Bau-, Stadtentwässerungsausschuss. Verwaltungsbeirat Münchner Sozialbürgerhäuser, Aufsichtsrat Münchenstift gGmbH, Mitglied im Ausländerbeirat, Kommission für Kunst am Bau, Eine- Welt-Haus, Behindertenbeirat, Kommission für Kommunale Kinder-, Jugend- und Bildungsplanung, Pädagogisches Institut, AK Wohnungslosigkeit, Spielmotor München e.V.\n\nSchwerpunkte:\n- Erhalt von bezahlbarem Wohnraum\n- Stärkung der Bürgerbeteiligung\n- Mehr Freiräume für Jugendliche\n- Motto: Politik von Bürgern für Bürger über Parteigrenzen hinweg', '', 'Zeilnhofer-Rath, Wolfgang', NULL, 'wolfgang.zeilnhoferrath', NULL),
